INSERT INTO `aboutus` VALUES (1, '<p><strong>ՏԵՂԵԿԱՏՎՈՒԹՅԱՆ ԵՎ ԱՆՁՆԱԿԱՆ ՏՎՅԱԼՆԵՐԻ ՊԱՇՏՊԱՆՈՒԹՅՈՒՆ,&nbsp; ԳՈՎԱԶԴ</strong></p>\r\n\r\n<p><strong>Ընկերությունը հավաստում է,</strong> որ Ձեր կողմից լրացված տեղեկատվությունը կայքի օգտվող որևէ անձ չի կարող տեսնել, այն գաղտնի է ոչ տեսանելի երրորդ անձանց համար և Ընկերությունը տեղյակ է և պահպանում է <strong>ՙՙԱնձնական տվյալների պաշտպանության մասին՚՚</strong> ՀՀ օրենքի պահանջները: Այն օգտագործվում է բացառապես այլ կազմակերպություններին <strong>վարկավորման</strong> կամ այլ ծառայություններից օգտվելու նպատակով <strong>հայտ-դիմումը</strong> մեր կայքի միջոցով Այցելու-Հաճախորդի կողմից ֆինասական ընկերությանն ուղարկելիս: Անձնական տեղեկությունները հավաքագրվում են (ստացվում են), օգտագործվում են և փոխանցվում այլ անձանց միայն այն ժամանակ, երբ Դուք դրանք տրամադրում եք <strong>կամավոր</strong>: Ընկերությունը կարող է իրականացնել անձնական տվյալների մշակում /անձնական տվյալների հետ որոշակի միջոցառումների և գործողությունների իրականացում/, որը կապված է անձնական տվյալների հավաքման, համակարգման, մուտքագրման, վերափոխման, փոխանցման, պահպանման, ուղղման, ուղեփակման, թարմացման, փոփոխման, օգտագործման, տարածման, ոչնչացման հետ, այդ թվում` ապաանհատականացում և բլոկավորում:</p>\r\n\r\n<p><strong>Ընկերությունն</strong> <strong>իրավունք</strong> <strong>ունի</strong> միակողմանի բլոկավորել /արգելել/ կայքի Ձեր այցելությունը, եթե պարզվի որ կայք այցելել եք այլ նպատակներով, կամ կատարել եք կասկածելի գործողություններ կամ ներբեռնումներ: <strong>Եթե Դուք լրացրել եք հայտ-դիմումը, ուրեմն Ընկերությանը տվել էք ամբողջական համաձայնություն Ձեր անձնական տվյալները մշակելու, պահպանելու, հավաքագրելու և փոխանցելու համար:</strong></p>\r\n\r\n<p>Մենք քաղաքացիա-իրավական պայմանագրերի հիման վրա համագործակցում ենք այլ կազմակերպությունների, անհատների հետ Ձեզ Ծառայություններ պատշաճ մատուցելու նպատակով, որոնց հիմնական ցանկը հրապարակված է և առկա են նշված անձանց պաշտոնական կայքերի հղումները: Ընկերությունը ձեռնարկելու է բոլոր միջոցները, թե տեղեկատվական անվտագության հետ կապված և թե&nbsp; էլեկտրոնային և այլ անվտանգության միջոցների անօրինական մուտքերից, ներխուժումներից, փոփոխումից կամ հրապարակումից Ձեր անձնական տվյալների և տեղեկությունների անվտանգությունն ապահովելու և պաշտպանելու համար: Ձեր անձնական տվյալները չեն տրամադրվելու որևէ երրորդ անձանց, առանց Ձեր համաձայնության՝ բացառությամբ ՀՀ Օրենսդրությամբ նախատեսված դեպքերի /իրավապահ կամ այլ իրավասու մարմիններ հայցմամբ/: Ընկերությունը ապահովելու է Վեբ ծառայության տեղեկատվական անվտանգության պատշաճ մակարդակը, որը կբացառի չլիազորված անձանց կողմից Կողմերի միջև փոխանակվող տեղեկությունները փոփոխելու և/կամ ջնջելու և/կամ անորոշ անձանց շրջանակի համար հասանելի դարձնելու հնարավորությունը:</p>\r\n\r\n<p><strong>Ընկերությունը հայտարարում է, որ պատասխանատվություն</strong> <strong>չի</strong> <strong>կ</strong><strong>ր</strong><strong>ում</strong> Ընկերության Կայքի միջոցով այլ անձանց /երրորդ անձանց, համագործակցող անձանց/ կողմից ինտերնետային կայքերի բովանդակության ստույգության և արժանահավատության, այնտեղ տեղադրված գովազդների, առաջարկվող և մատուցվող ծառայությունների, վարկային առաջարկների և պրոդուկտների, դրանց հաստատման կամ մերժման և ընթացքի համար, նաև կայքերում տեղադրված տեղեկատվության օգտագործման արդյունքում առաջացած հնարավոր հետևանքների համար:</p>\r\n\r\n<p>Անվտանգության նկատառումներից ելնելով խորհուրդ ենք տալիս Այցելու-Հաճախորդներին և կայքից&nbsp; օգտվողներին ձեռնարկել հետևյալ անվտանգության <strong>միջոցառումները՝</strong></p>\r\n\r\n<p>-Ընկերության կայք մուտք գործելու համար Ձեր համակարգչի զննարկիչից (բրաուզերից) մուտքագրեք պաշտոնական հասցեն` <a href=\"http://www.oferta.am\">www.oferta.am</a>,&nbsp; այլ ոչ թե հղում կատարեք մեկ այլ կայքից կամ որևէ նամակից.</p>\r\n\r\n<p>-Առցանց գործողություններ իրականացնելիս ուշադրություն դարձրեք հասցեի սկզբում https:// գրառմանը: Գրառման առկայությունը վկայում է, որ փոխանակվող ինֆորմացիան գաղտնագրված է, Համոզվելուց հետո նոր մուտքագրեք Ձեր անձնական տվյալները.</p>\r\n\r\n<p>-Օգտագործեք զննարկիչի (բրաուզերի) Private browsing հնարավորությունը.</p>\r\n\r\n<p>-Զգուշացեք կասկածելի էլեկտրոնային նամակներից և հեռախոսազանգերից, որոնք կպահանջեն անձնական տվյալներ` գաղտնաբառ, քարտի համար, cvv կոդ և այլն.</p>\r\n\r\n<p>-Օգտագործեք հակավիրուսային համակարգեր և ժամանակին դրանք թարմացրեք.</p>\r\n\r\n<p>-Օգտագործեք բրաուզերների վերջին տարբերակները, օպերացիոն համակարգը նույնպես պետք է պարբերաբար թարմացվի:</p>\r\n\r\n<p>Օֆերտա Կայքը կարող է պարունակել այլ Կայքերի հղումներ կամ հիպերհղումներ, ձայնա-տեսանյութեր, հոդվածներ,&nbsp; գրաֆիկներ,&nbsp; լուսանկարներ, ապրանքներ, առաջարկներ, գրաֆիկ նկարներ, տեղեկություններ, ծրագրեր և այլն, որոնք պատկանում են երրորդ անձանց, սակայն &nbsp;Ընկերությունը չի ներկայացնում այդ Երրորդ անձանց, չի գործում նրանց անունից, չի հանդիսանում նրանց ներկայացուցիչը, չի ստուգել և չի ստուգելու դրանց կողմից տրամադրված նյութերի ամբողջականությունը, ճշմարտացիությունը, հավաստիությունը և պատասխանատվություն չի կրում Երրորդ անձանց նյութերի և Այլ Կայքերի համար:</p>\r\n\r\n<p><strong>Ես՝ Օֆերտա կայքի Այցելու-Հաճախորդս հաստատում, հայտարարում և հավաստում եմ</strong><strong>, </strong><strong>որ</strong><strong> հանդիսանում եմ </strong><strong>լրիվ</strong> <strong>գործունակ</strong><strong> և իրավունակ անձ </strong><strong>և</strong> <strong>իրավունք</strong> <strong>ունեմ</strong> <strong>օգտվել կայքի Ծառայություններից և առաջարկներից</strong><strong>: Ես չեմ հանդիսանում անչափահաս, կամ սնանկ ճանաչված անձ: Իմ նկատմամբ չկա հարուցված որևէ քրեական հետապնդում կամ դատական այլ վարույթներ: </strong><strong>Եթե</strong> <strong>Դուք</strong> <strong>ներկայացնում</strong> <strong>եք</strong> <strong>իրավաբանական</strong> <strong>անձ</strong><strong>, </strong><strong>ապա</strong> <strong>Դուք</strong> <strong>հավաստում</strong> <strong>եք</strong><strong>, </strong><strong>որ</strong> <strong>ունեք</strong> <strong>բոլոր</strong> <strong>իրավասությունները</strong> <strong>տրված</strong> <strong>իրավաբանական</strong> <strong>անձի</strong> <strong>կողմից</strong><strong> ունեք ՀՀ Օրենսդրությամբ սահմանված ներկայացուցչական իրավունք /լիազորագիր/ կամ ընկերության կանոնադրությամբ սահմանված իրավունքներ՝ </strong><strong>օգտվելու</strong><strong> Կայքի առաջարկած </strong><strong>Ծառայություններից</strong>:</p>\r\n\r\n<p><strong>Եթե</strong> <strong>Դուք</strong> <strong>համաձայն</strong> <strong>չեք</strong> <strong>սույն</strong> <strong>Պայմաններին և ընդհանուր դրույթներին</strong><strong>, գաղտնիության պայմաններին, ապա Խ</strong><strong>նդրում</strong> <strong>ենք</strong> <strong>դադարեցնել</strong> <strong>Կայքի</strong> <strong>օգտագործումը և դուրս գալ կայքից և դադարեցնել Կայքում</strong> <strong>գտնվելը</strong><strong>, հղումներից օգտվելը, բանկերի կամ վարկային կազմակերպությունների առաջարկած ծառայություններն ուսումնասիրելը: Եթե շարունակում եք օգտվել կայքից, ապա Դուք հավաստում և փաստում եք, որ ընդունել եք կայքում հրապարակված բոլոր պայմանները:&nbsp; </strong></p>\r\n\r\n<p><strong>Ես՝ Այցելու-Հաճախորդս հավաստում եմ, որ վարկային հայտ-դիմումն ուղարկել եմ </strong><a href=\"http://www.oferta.am\"><strong>www.oferta.am</strong></a><strong>&nbsp; կայքի միջոցով: </strong></p>\r\n\r\n<p>&nbsp;</p>\r\n', 'asdasd', 'asdasdasd');
