INSERT INTO `commentscontroller` VALUES (239, 4626877, 'Բանկը ֆինանսավորում է այն Հաճախորդներին, որոնք Բանկ դիմելու պահին  չունեն հարկային և նմանատիպ ժամկետանց պարտավորություններ', ' ', ' ', NULL, NULL, NULL, NULL, NULL, NULL);
