INSERT INTO `commentscontroller` VALUES (242, 4629300, 'Վարկերը տրամադրվում են ՀՀ և ԱՀ քաղաքացի և/կամ ռեզիդենտ ֆիզիկական անձանց', ' ', ' ', NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `commentscontroller` VALUES (243, 4628470, 'Պետության կողմից սուբսիդավորվում է. ք.Երևանում` 2 տոկոսային կետ, ՀՀ մարզերում` 4 տոկոսային կետ', '  ', '  ', NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `commentscontroller` VALUES (244, 4628229, 'Վարկերը տրամադրվում են  ԱՀ ռեզիդենտ ֆիզիկական անձանց ԱՀ տարածքում բնակարան, բնակելի տուն ձեռքբերելու, կառուցելու, վերակառուցելու, վերանորոգելու, բարեկարգելու կամ արդիականացնելու նպատակով', ' ', ' ', NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `commentscontroller` VALUES (245, 9363722, '\"Մելլաթ Բանկ\" ՓԲԸ-ն, ՀՀ ռեզիդենտ և ոչ ռեզիդենտ ֆիզիկական անձանց, տրամադրում է անշարժ գույքի ձեռքբերման հիփոթեքային վարկեր', ' ', ' ', NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `commentscontroller` VALUES (246, 9369381, '\"Մելլաթ Բանկ\" ՓԲԸ-ն, ՀՀ ռեզիդենտ և ոչ ռեզիդենտ ֆիզիկական անձանց, տրամադրում է անշարժ գույքի վերանորոգման հիփոթեքային վարկեր', ' ', ' ', NULL, NULL, NULL, NULL, NULL, NULL);
