INSERT INTO `staticcontroller` VALUES (28046, 'Հիփոթեք', 'AMD', NULL, 'hy', '2020-06-08', 'D697E2C20636FEB908451CD27CEF4C76');
INSERT INTO `terms` VALUES (1, '<p><strong>ՏԵՂԵԿԱՏՎՈՒԹՅԱՆ ԵՎ ԱՆՁՆԱԿԱՆ ՏՎՅԱԼՆԵՐԻ ՊԱՇՏՊԱՆՈՒԹՅՈՒՆ,&nbsp; ԳՈՎԱԶԴ</strong></p>\r\n\r\n<p><br />\r\nԸնկերությունը հավաստում է, որ Ձեր կողմից լրացված տեղեկատվությունը կայքի օգտվող որևէ անձ չի կարող տեսնել, այն գաղտնի է ոչ տեսանելի երրորդ անձանց համար և Ընկերությունը տեղյակ է և պահպանում է ՙՙԱնձնական տվյալների պաշտպանության մասին՚՚ ՀՀ օրենքի պահանջները: Այն օգտագործվում է բացառապես այլ կազմակերպություններին վարկավորման կամ այլ ծառայություններից օգտվելու նպատակով հայտ-դիմումը մեր կայքի միջոցով Այցելու-Հաճախորդի կողմից ֆինասական ընկերությանն ուղարկելիս: Անձնական տեղեկությունները հավաքագրվում են (ստացվում են), օգտագործվում են և փոխանցվում այլ անձանց միայն այն ժամանակ, երբ Դուք դրանք տրամադրում եք կամավոր: Ընկերությունը կարող է իրականացնել անձնական տվյալների մշակում /անձնական տվյալների հետ որոշակի միջոցառումների և գործողությունների իրականացում/, որը կապված է անձնական տվյալների հավաքման, համակարգման, մուտքագրման, վերափոխման, փոխանցման, պահպանման, ուղղման, ուղեփակման, թարմացման, փոփոխման, օգտագործման, տարածման, ոչնչացման հետ, այդ թվում` ապաանհատականացում և բլոկավորում:<br />\r\n<br />\r\nԸնկերությունն իրավունք ունի միակողմանի բլոկավորել /արգելել/ կայքի Ձեր այցելությունը, եթե պարզվի որ կայք այցելել եք այլ նպատակներով, կամ կատարել եք կասկածելի գործողություններ կամ ներբեռնումներ: Եթե Դուք լրացրել եք հայտ-դիմումը, ուրեմն Ընկերությանը տվել էք ամբողջական համաձայնություն Ձեր անձնական տվյալները մշակելու, պահպանելու, հավաքագրելու և փոխանցելու համար:<br />\r\n<br />\r\nՄենք քաղաքացիա-իրավական պայմանագրերի հիման վրա համագործակցում ենք այլ կազմակերպությունների, անհատների հետ Ձեզ Ծառայություններ պատշաճ մատուցելու նպատակով, որոնց հիմնական ցանկը հրապարակված է և առկա են նշված անձանց պաշտոնական կայքերի հղումները: Ընկերությունը ձեռնարկելու է բոլոր միջոցները, թե տեղեկատվական անվտագության հետ կապված և թե&nbsp; էլեկտրոնային և այլ անվտանգության միջոցների անօրինական մուտքերից, ներխուժումներից, փոփոխումից կամ հրապարակումից Ձեր անձնական տվյալների և տեղեկությունների անվտանգությունն ապահովելու և պաշտպանելու համար: Ձեր անձնական տվյալները չեն տրամադրվելու որևէ երրորդ անձանց, առանց Ձեր համաձայնության՝ բացառությամբ ՀՀ Օրենսդրությամբ նախատեսված դեպքերի /իրավապահ կամ այլ իրավասու մարմիններ հայցմամբ/: Ընկերությունը ապահովելու է Վեբ ծառայության տեղեկատվական անվտանգության պատշաճ մակարդակը, որը կբացառի չլիազորված անձանց կողմից Կողմերի միջև փոխանակվող տեղեկությունները փոփոխելու և/կամ ջնջելու և/կամ անորոշ անձանց շրջանակի համար հասանելի դարձնելու հնարավորությունը:<br />\r\n<br />\r\nԸնկերությունը հայտարարում է, որ պատասխանատվություն չի կրում Ընկերության Կայքի միջոցով այլ անձանց /երրորդ անձանց, համագործակցող անձանց/ կողմից ինտերնետային կայքերի բովանդակության ստույգության և արժանահավատության, այնտեղ տեղադրված գովազդների, առաջարկվող և մատուցվող ծառայությունների, վարկային առաջարկների և պրոդուկտների, դրանց հաստատման կամ մերժման և ընթացքի համար, նաև կայքերում տեղադրված տեղեկատվության օգտագործման արդյունքում առաջացած հնարավոր հետևանքների համար:<br />\r\nԱնվտանգության նկատառումներից ելնելով խորհուրդ ենք տալիս Այցելու-Հաճախորդներին և կայքից&nbsp; օգտվողներին ձեռնարկել հետևյալ անվտանգության միջոցառումները՝<br />\r\n-Ընկերության կայք մուտք գործելու համար Ձեր համակարգչի զննարկիչից (բրաուզերից) մուտքագրեք պաշտոնական հասցեն` www.oferta.am,&nbsp; այլ ոչ թե հղում կատարեք մեկ այլ կայքից կամ որևէ նամակից.<br />\r\n<br />\r\n-Առցանց գործողություններ իրականացնելիս ուշադրություն դարձրեք հասցեի սկզբում https:// գրառմանը: Գրառման առկայությունը վկայում է, որ փոխանակվող ինֆորմացիան գաղտնագրված է, Համոզվելուց հետո նոր մուտքագրեք Ձեր անձնական տվյալները.<br />\r\n-Օգտագործեք զննարկիչի (բրաուզերի) Private browsing հնարավորությունը.<br />\r\n<br />\r\n-Զգուշացեք կասկածելի էլեկտրոնային նամակներից և հեռախոսազանգերից, որոնք կպահանջեն անձնական տվյալներ` գաղտնաբառ, քարտի համար, cvv կոդ և այլն.<br />\r\n-Օգտագործեք հակավիրուսային համակարգեր և ժամանակին դրանք թարմացրեք.<br />\r\n<br />\r\n-Օգտագործեք բրաուզերների վերջին տարբերակները, օպերացիոն համակարգը նույնպես պետք է պարբերաբար թարմացվի:<br />\r\n<br />\r\nՕֆերտա Կայքը կարող է պարունակել այլ Կայքերի հղումներ կամ հիպերհղումներ, ձայնա-տեսանյութեր, հոդվածներ,&nbsp; գրաֆիկներ,&nbsp; լուսանկարներ, ապրանքներ, առաջարկներ, գրաֆիկ նկարներ, տեղեկություններ, ծրագրեր և այլն, որոնք պատկանում են երրորդ անձանց, սակայն&nbsp; Ընկերությունը չի ներկայացնում այդ Երրորդ անձանց, չի գործում նրանց անունից, չի հանդիսանում նրանց ներկայացուցիչը, չի ստուգել և չի ստուգելու դրանց կողմից տրամադրված նյութերի ամբողջականությունը, ճշմարտացիությունը, հավաստիությունը և պատասխանատվություն չի կրում Երրորդ անձանց նյութերի և Այլ Կայքերի համար:<br />\r\n<br />\r\nԵս՝ Օֆերտա կայքի Այցելու-Հաճախորդս հաստատում, հայտարարում և հավաստում եմ, որ հանդիսանում եմ լրիվ գործունակ և իրավունակ անձ և իրավունք ունեմ օգտվել կայքի Ծառայություններից և առաջարկներից: Ես չեմ հանդիսանում անչափահաս, կամ սնանկ ճանաչված անձ: Իմ նկատմամբ չկա հարուցված որևէ քրեական հետապնդում կամ դատական այլ վարույթներ: Եթե Դուք ներկայացնում եք իրավաբանական անձ, ապա Դուք հավաստում եք, որ ունեք բոլոր իրավասությունները տրված իրավաբանական անձի կողմից ունեք ՀՀ Օրենսդրությամբ սահմանված ներկայացուցչական իրավունք /լիազորագիր/ կամ ընկերության կանոնադրությամբ սահմանված իրավունքներ՝ օգտվելու Կայքի առաջարկած Ծառայություններից:<br />\r\n<br />\r\nԵթե Դուք համաձայն չեք սույն Պայմաններին և ընդհանուր դրույթներին, գաղտնիության պայմաններին, ապա Խնդրում ենք դադարեցնել Կայքի օգտագործումը և դուրս գալ կայքից և դադարեցնել Կայքում գտնվելը, հղումներից օգտվելը, բանկերի կամ վարկային կազմակերպությունների առաջարկած ծառայություններն ուսումնասիրելը: Եթե շարունակում եք օգտվել կայքից, ապա Դուք հավաստում և փաստում եք, որ ընդունել եք կայքում հրապարակված բոլոր պայմանները: &nbsp;<br />\r\n<br />\r\nԵս՝ Այցելու-Հաճախորդս հավաստում եմ, որ վարկային հայտ-դիմումն ուղարկել եմ www.oferta.am&nbsp; կայքի միջոցով:<br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'rus', 'eng');
