INSERT INTO `userfularticlescontroller` VALUES (8, 'ԱՄՀ․Գլոբալ տնտեսությունը կկարողանա վերացնել համավարակի հետեւանքները', 'ԱՄՀ․Գլոբալ տնտեսությունը կկարողանա վերացնել համավարակի հետեւանքները', 'ԱՄՀ․Գլոբալ տնտեսությունը կկարողանա վերացնել համավարակի հետեւանքները', '<p>Ինչպես&nbsp;<strong><a href=\"https://tass.ru/ekonomika/8041355\" target=\"_blank\">հաղորդում է</a></strong>&nbsp;ՏԱՍՍ-ը, այս մասին հայտարարել է Արժույթի միջազգային հիմնադրամի (ԱՄՀ) ռազմավարության, քաղաքականության եւ վերլուծության դեպարտամենտի տնօրեն Մարտին Մյուլեյզենը։<br />\r\n<br />\r\n&laquo;Հուսով եմ, որ մենք կարող ենք հաղթահարել այս ճգնաժամը: Կարծում եմ՝ միջազգային հանրության եւ առանձին երկրների մոտ կան միջոցներ, որոնց օգնությամբ մենք դուրս կգանք այս իրավիճակից։ Սա ժամանակավոր ճգնաժամ է&raquo;,- ընդգծել է ԱՄՀ դեպարտամենտի ղեկավարը։<br />\r\n<br />\r\nՆրա խոսքով՝ &laquo;ճգնաժամի դեմ պայքարի էությունը պետք է կայանա վարակի տարածման սահմանափակման մեջ&raquo;։<br />\r\n<br />\r\n&laquo;Պետք է այնպես անել, որպեսզի ինչ-որ պահին վստահություն առաջանա, որ սա ժամանակավոր ցնցում է լինելու, իսկ հետեւանքները չեն տեւի երկար ամիսներ&raquo;,- կարծում է ԱՄՀ ներկայացուցիչը։<br />\r\n<br />\r\nՆա նշել է, որ աշխարհի երկրների ԿԲ-ները եւ կառավարությունները բազմաթիվ աննախադեպ միջոցներ են ձեռնարկել՝ շուկաներին իրացվելիության տրամադրման եւ դրանց գործունեության ապահովման համար։ &laquo;Միգուցե, ավելին, քան անհրաժեշտ է&raquo;,- հավելել է մասնագետը։<br />\r\n<br />\r\nՄյուլեյզենն ընդգծել է ձեռնարկվող քայլերի համակարգման անհրաժեշտությունը՝ &laquo;ամեն մի առանձին կառավարության կամ կենտրոնական բանկի գործողության ուժեղացման նպատակով&raquo;։<br />\r\n<br />\r\nՆա նաեւ կարեւորում է &laquo;մի շարք երկրների բարձր պարտքի հարցի վերաիմաստավորումը՝ ներկայիս ճգնաժամից դուրս գալու ճանապարհին&raquo;։<br />\r\n<br />\r\nԱՄՀ ներկայացուցիչը նշել է &laquo;զարգացող տնտեսություն ունեցող երկրներից կապիտալի կտրուկ արտահոսքի մասին&raquo;։<br />\r\n<br />\r\n&laquo;Սա խնդիր է, որը շատ դժվար կլինի լուծել, սակայն ԱՄՀ-ն կարող է օգնել&raquo;,- ասել է Մյուլեյզենը։</p>\r\n', '<p>Ինչպես&nbsp;<strong><a href=\"https://tass.ru/ekonomika/8041355\" target=\"_blank\">հաղորդում է</a></strong>&nbsp;ՏԱՍՍ-ը, այս մասին հայտարարել է Արժույթի միջազգային հիմնադրամի (ԱՄՀ) ռազմավարության, քաղաքականության եւ վերլուծության դեպարտամենտի տնօրեն Մարտին Մյուլեյզենը։<br />\r\n<br />\r\n&laquo;Հուսով եմ, որ մենք կարող ենք հաղթահարել այս ճգնաժամը: Կարծում եմ՝ միջազգային հանրության եւ առանձին երկրների մոտ կան միջոցներ, որոնց օգնությամբ մենք դուրս կգանք այս իրավիճակից։ Սա ժամանակավոր ճգնաժամ է&raquo;,- ընդգծել է ԱՄՀ դեպարտամենտի ղեկավարը։<br />\r\n<br />\r\nՆրա խոսքով՝ &laquo;ճգնաժամի դեմ պայքարի էությունը պետք է կայանա վարակի տարածման սահմանափակման մեջ&raquo;։<br />\r\n<br />\r\n&laquo;Պետք է այնպես անել, որպեսզի ինչ-որ պահին վստահություն առաջանա, որ սա ժամանակավոր ցնցում է լինելու, իսկ հետեւանքները չեն տեւի երկար ամիսներ&raquo;,- կարծում է ԱՄՀ ներկայացուցիչը։<br />\r\n<br />\r\nՆա նշել է, որ աշխարհի երկրների ԿԲ-ները եւ կառավարությունները բազմաթիվ աննախադեպ միջոցներ են ձեռնարկել՝ շուկաներին իրացվելիության տրամադրման եւ դրանց գործունեության ապահովման համար։ &laquo;Միգուցե, ավելին, քան անհրաժեշտ է&raquo;,- հավելել է մասնագետը։<br />\r\n<br />\r\nՄյուլեյզենն ընդգծել է ձեռնարկվող քայլերի համակարգման անհրաժեշտությունը՝ &laquo;ամեն մի առանձին կառավարության կամ կենտրոնական բանկի գործողության ուժեղացման նպատակով&raquo;։<br />\r\n<br />\r\nՆա նաեւ կարեւորում է &laquo;մի շարք երկրների բարձր պարտքի հարցի վերաիմաստավորումը՝ ներկայիս ճգնաժամից դուրս գալու ճանապարհին&raquo;։<br />\r\n<br />\r\nԱՄՀ ներկայացուցիչը նշել է &laquo;զարգացող տնտեսություն ունեցող երկրներից կապիտալի կտրուկ արտահոսքի մասին&raquo;։<br />\r\n<br />\r\n&laquo;Սա խնդիր է, որը շատ դժվար կլինի լուծել, սակայն ԱՄՀ-ն կարող է օգնել&raquo;,- ասել է Մյուլեյզենը։</p>\r\n', '<p>Ինչպես&nbsp;<strong><a href=\"https://tass.ru/ekonomika/8041355\" target=\"_blank\">հաղորդում է</a></strong>&nbsp;ՏԱՍՍ-ը, այս մասին հայտարարել է Արժույթի միջազգային հիմնադրամի (ԱՄՀ) ռազմավարության, քաղաքականության եւ վերլուծության դեպարտամենտի տնօրեն Մարտին Մյուլեյզենը։<br />\r\n<br />\r\n&laquo;Հուսով եմ, որ մենք կարող ենք հաղթահարել այս ճգնաժամը: Կարծում եմ՝ միջազգային հանրության եւ առանձին երկրների մոտ կան միջոցներ, որոնց օգնությամբ մենք դուրս կգանք այս իրավիճակից։ Սա ժամանակավոր ճգնաժամ է&raquo;,- ընդգծել է ԱՄՀ դեպարտամենտի ղեկավարը։<br />\r\n<br />\r\nՆրա խոսքով՝ &laquo;ճգնաժամի դեմ պայքարի էությունը պետք է կայանա վարակի տարածման սահմանափակման մեջ&raquo;։<br />\r\n<br />\r\n&laquo;Պետք է այնպես անել, որպեսզի ինչ-որ պահին վստահություն առաջանա, որ սա ժամանակավոր ցնցում է լինելու, իսկ հետեւանքները չեն տեւի երկար ամիսներ&raquo;,- կարծում է ԱՄՀ ներկայացուցիչը։<br />\r\n<br />\r\nՆա նշել է, որ աշխարհի երկրների ԿԲ-ները եւ կառավարությունները բազմաթիվ աննախադեպ միջոցներ են ձեռնարկել՝ շուկաներին իրացվելիության տրամադրման եւ դրանց գործունեության ապահովման համար։ &laquo;Միգուցե, ավելին, քան անհրաժեշտ է&raquo;,- հավելել է մասնագետը։<br />\r\n<br />\r\nՄյուլեյզենն ընդգծել է ձեռնարկվող քայլերի համակարգման անհրաժեշտությունը՝ &laquo;ամեն մի առանձին կառավարության կամ կենտրոնական բանկի գործողության ուժեղացման նպատակով&raquo;։<br />\r\n<br />\r\nՆա նաեւ կարեւորում է &laquo;մի շարք երկրների բարձր պարտքի հարցի վերաիմաստավորումը՝ ներկայիս ճգնաժամից դուրս գալու ճանապարհին&raquo;։<br />\r\n<br />\r\nԱՄՀ ներկայացուցիչը նշել է &laquo;զարգացող տնտեսություն ունեցող երկրներից կապիտալի կտրուկ արտահոսքի մասին&raquo;։<br />\r\n<br />\r\n&laquo;Սա խնդիր է, որը շատ դժվար կլինի լուծել, սակայն ԱՄՀ-ն կարող է օգնել&raquo;,- ասել է Մյուլեյզենը։</p>\r\n', 'http://www.oferta.am/uploadBlog/PEK png.png', '2020-03-21 00:00:00');
INSERT INTO `userfularticlescontroller` VALUES (11, 'Պարզաբանումներ՝ արտակարգ դրության ժամանակ աշխատողների իրավունքների մասին', 'Պարզաբանումներ՝ արտակարգ դրության ժամանակ աշխատողների իրավունքների մասին', 'Պարզաբանումներ՝ արտակարգ դրության ժամանակ աշխատողների իրավունքների մասին', '<p>Հաշվի առնելով, որ 2020 թ.-ի մարտի 16-ից ՀՀ-ում հայտարարված արտակարգ դրությունը մի շարք հարցեր է առաջացրել տվյալ իրավիճակում աշխատանքային օրենսդրության առկա կարգավորումների, ինչպես նաեւ Աշխատանքի եւ սոցիալական հարցերի նախարարության կողմից առկա բացերի լրացման նպատակով իրականացվող միջոցառումների վերաբերյալ, տեղեկացնում ենք.<br />\r\n<br />\r\nԱշխատանքային օրենսգրքի 107-րդ հոդվածի 1-ին եւ 2-րդ մասերի համաձայն՝<br />\r\n<br />\r\n- ոչ աշխատողի մեղքով պարապուրդը աշխատավայրում ստեղծված այն իրավիճակն է, որի ժամանակ գործատուն՝ արտադրական կամ օբյեկտիվ այլ պատճառներով պայմանավորված, չի կարողանում ապահովել աշխատողի` աշխատանքային պայմանագրով նախատեսված աշխատանքը,<br />\r\n<br />\r\n- պարապուրդի ժամանակ գործատուն իրավունք ունի աշխատողին՝ նրա գրավոր համաձայնությամբ, փոխադրելու ցանկացած այլ աշխատանքի` հաշվի առնելով աշխատողի մասնագիտությունը, որակավորումը եւ առողջական վիճակը: Աշխատողի համաձայնությամբ՝ նա կարող է փոխադրվել նաեւ այլ աշխատանքի` առանց հաշվի առնելու նրա մասնագիտությունը եւ որակավորումը:<br />\r\n<br />\r\nՄյուս կողմից, Աշխատանքային օրենսգրքի 186-րդ հոդվածի 1-ին մասի համաձայն, եթե ոչ աշխատողի մեղքով պարապուրդի ժամանակ աշխատողին չի առաջարկվում նրա մասնագիտությանը, որակավորմանը համապատասխանող այլ աշխատանք, որը նա կարող էր կատարել՝ առանց իր առողջությանը վնաս պատճառելու, ապա աշխատողին պարապուրդի յուրաքանչյուր ժամվա համար վճարվում է մինչեւ պարապուրդը նրա միջին ժամային աշխատավարձի երկու երրորդի չափով, սակայն ոչ պակաս, քան օրենսդրությամբ սահմանված նվազագույն ժամային դրույքաչափը:<br />\r\n<br />\r\nՆույն հոդվածի 6-րդ մասի համաձայն՝ Հայաստանի Հանրապետության օրենսդրությամբ սահմանված կարգով անհաղթահարելի ուժ համարվող պատճառներով առաջացած պարապուրդի համար չի վճարվում:<br />\r\n<br />\r\nՎերջին օրերի զարգացումները ցույց են տալիս, որ գործատուների մի մասը առաջնորդվում է Աշխատանքային օրենսգրքի 186-րդ հոդվածի 1-ին մասի կարգավորմամբ եւ վճարում իր աշխատողներին, մի մասն էլ՝ նույն հոդվածի 6-րդ մասով՝ ընդհանրապես չվճարելով:<br />\r\n<br />\r\nԱկնհայտ է, որ ստեղծված իրավիճակում անհրաժեշտ է ցուցաբերել մեկ միասնական մոտեցում՝ ապագայում հնարավոր աշխատանքային վեճերից խուսափելու եւ խնդիրները դատական կարգով չլուծելու համար:<br />\r\n<br />\r\nԱյս եւ ՀՀ-ում արտակարգ դրություն հայտարարված լինելու հանգամանքով պայմանավորված՝ Աշխատանքային օրենսգրքի մի շարք այլ կարգավորումներում եւս որոշակի լրացումներ կատարելու նպատակով՝ Աշխատանքի եւ սոցիալական հարցերի նախարարության կողմից մշակվել եւ հրատապ ռեժիմով շրջանառության է դրվել Աշխատանքային օրենսգրքում համապատասխան փոփոխություններ կատարելու նախագիծ: Մասնավորապես նախագծով առաջարկվում է՝<br />\r\n<br />\r\n- հեռավար եղանակով աշխատանքների կազմակերպման հնարավորության պարագայում, աշխատողներին չհամարել պարապուրդի մեջ, եւ աշխատավարձն ամբողջությամբ պահպանել,<br />\r\n<br />\r\n- հեռավար եղանակով աշխատանքերի կազմակերպումը եւ աշխատանքի ու հանգստի ռեժիմի փոփոխությունը չհամարել աշխատանքային պայմանագրի էական պայմանի փոփոխություն, ինչը հնարավորություն կտա գործատուներին լինել ավելի ճկուն եւ նախապես չծանուցել այդ փոփոխությունների մասին,<br />\r\n<br />\r\n- այն դեպքերում, երբ&nbsp;<strong>մասնավոր ոլորտի գործատուն</strong>, արտակարգ դրությամբ պայմանավորված, չկարողանա այլեւս աշխատանքները շարունակել, այդ թվում հեռավար եղանակով, այնուամենայնիվ շարունակի վարձատրել աշխատողին՝ չաշխատած յուրաքանչյուր ժամի համար՝ առնվազն օրենսդրությամբ սահմանված նվազագույն ժամային դրույքաչափով։ Պետական եւ համայնքային բյուջեներից ֆինանսավորվող կազմակերպությունների, ինչպես նաեւ Հայաստանի Հանրապետության կենտրոնական բանկի աշխատողների աշխատավարձն ամբողջությամբ պահպանվում է։<br />\r\n<br />\r\n- այն դեպքերում, երբ աշխատողն ունի չօգտագործված արձակուրդ, եւ հնարավոր չէ շարունակել աշխատանքները արտակարգ դրության ժամանակահատվածում, գործատուի համար նախատեսել պարտադիր պահանջ, որ աշխատողի ցանկության դեպքում վերջինիս տրամադրի իր չօգտագործված արձակուրդը,</p>\r\n\r\n<p>- այն դեպքերում, երբ արտակարգ դրությամբ պայմանավորված, աշխատողն օբյեկտիվորեն հնարավորություն չի ունեցել ներկայանալու աշխատանքի կամ աշխատանքի է ներկայացել ուշացումով կամ ոչ լրիվ աշխատանքային օրով, արգելել գործատուին իր նախաձեռնությամբ լուծելու աշխատանքային պայմանագիրը կամ կիրառել կարգապահական տույժ։ Այս դեպքերում, նախատեսել վարձատրություն առնվազն աշխատողի փաստացի աշխատած ժամանակին կամ կատարված փաստացի աշխատանքին համապատասխան։<br />\r\n<br />\r\n- այն դեպքերում, երբ ուսումնական (այդ թվում՝ նախադպրոցական) հաստատությունների համար նախատեսված արձակուրդների՝ չպլանավորված տեղափոխման կամ տրամադրման ժամանակահատվածում, երեխայի խնամքը կազմակերպելու նպատակով՝ աշխատողը աշխատանքի է ներկայացել ուշացումով կամ ոչ լրիվ աշխատանքային օրով, արգելել գործատուին իր նախաձեռնությամբ լուծելու աշխատանքային պայմանագիրը կամ կիրառել կարգապահական տույժ։ Այս դեպքերում, նախատեսել ամբողջական վարձատրություն։<br />\r\n<br />\r\n- նախատեսել դրույթ, որ արտակարգ դրության ժամանակ արտաժամյա աշխատանքը իրար հաջորդող երկու օրվա ընթացքում կարող է կազմել մինչեւ 8 ժամ՝ ներկայիս 4-ի փոխարեն,<br />\r\n<br />\r\n- անցումային դրույթներով նախատեսվելու է նաեւ, որ վերը թվարկված կարգավորումները տարածվելու են գործատուների եւ աշխատողների վրա սկսած 2020 թվականի մարտի 16-ից, երբ հայտարարվեց արտակարգ դրություն:<br />\r\n<br />\r\nՀարկ է նշել, որ Նախագծով ներկայացված մի շարք առաջարկներ բխում են աշխատանքային օրենսգրքի հիմնական սկզբունքներից (3-րդ հոդված), մասնավորապես՝<br />\r\n<br />\r\n- յուրաքանչյուր աշխատողի համար աշխատանքի արդարացի պայմանների իրավունքի ապահովումը,<br />\r\n<br />\r\n- յուրաքանչյուր աշխատողի` ժամանակին եւ ամբողջությամբ աշխատանքի արդարացի վարձատրության իրավունքի ապահովումը` օրենքով սահմանված նվազագույն աշխատավարձի չափից ոչ ցածր:<br />\r\n<br />\r\nՄիաժամանակ, անդրադառնալով վերջին օրերին հնչած այն տեսակետին, որ հեռավար եղանակով աշխատանքների կազմակերպման մասով Աշխատանքային օրենսգրքում փոփոխություններ կատարելու անհրաժեշտությունը բացակայում է, քանի որ տնաշխատների՝ աշխատանքի եւ վարձատրության հետ կապված հարաբերություններն արդեն իսկ կարգավորված են Աշխատանքային օրենսգրքով, մասնավորապես 98-րդ հոդվածով, տեղեկացնում ենք, որ գործող կարգավորմամբ՝ աշխատանքի վայրը համարվում է աշխատանքային պայմանագրի էական պայման, որի փոփոխման դեպքում գործատուն պարտավոր է նախապես ծանուցել աշխատողին կախված նրա ստաժից համապատասխան օր առաջ (Աշխատանքային օրենսգրքի 115-րդ հոդվածի 1-ին մաս): Հաշվի առնելով, որ արտակարգ դրության պայմաններում գործատուն պետք է արագ արձագանքի ստեղծված մարտահրավերներին եւ հնարավորության դեպքում աշխատանքները կազմակերպի հեռավար եղանակով, նախագծով առաջարկվում է, որ այս իրավիճակում հեռավար եղանակով աշխատանքների կազմակերպումը չհամարվի աշխատանքի վայրի փոփոխություն:<br />\r\n<br />\r\nԻնչ վերաբերվում է հեռավար աշխատանքի՝ Աշխատանքային օրենսգրքի 98-րդ հոդվածով արդեն իսկ կարգավորված լինելուն, ապա նշենք, որ այդ հոդվածը վերաբերում է այն դեպքերին, երբ ի սկզբանե, աշխատանքի բնույթից ելնելով, գործատուի եւ աշխատողի միջեւ կնքվել է աշխատանքային պայմանագիր աշխատանքները տանից կատարելու վերաբերյալ:<br />\r\n<br />\r\nԱրտակարգ դրության պայմաններում ոչ թե կնքվում է աշխատանքային պայմանագիր՝ աշխատանքները հեռավար իրականացնելու համար, այլ ուղղակի փոփոխվում է աշխատանքի վայրը: Հետեւաբար՝ ճիշտ չէ որեւէ կերպ նույնականացնել տնաշխատների համար նախատեսված կարգավորումը՝ հեռավար եղանակով աշխատանք կատարելու կարգավորման հետ:<br />\r\n<br />\r\nՄիաժամանակ տեղեկացնում ենք, որ Աշխատանքի եւ սոցիալական հարցերի նախարարությունը աշխատողի եւ գործատուի միջեւ ծագած խնդիրնեըը իրավասու է լուծելու համապատասխան օրենսդրական կարգավորումներ մշակելու եւ պարզաբանումներ տրամադրելու շրջանակներում միայն: Նախարարությունը, իր լիազորութունների շրջանակներում, աշխատողի եւ գործատուի աշխատանքային հարաբերութուններին միջամտելու իրավասություն չունի:</p>\r\n', '<p>Հաշվի առնելով, որ 2020 թ.-ի մարտի 16-ից ՀՀ-ում հայտարարված արտակարգ դրությունը մի շարք հարցեր է առաջացրել տվյալ իրավիճակում աշխատանքային օրենսդրության առկա կարգավորումների, ինչպես նաեւ Աշխատանքի եւ սոցիալական հարցերի նախարարության կողմից առկա բացերի լրացման նպատակով իրականացվող միջոցառումների վերաբերյալ, տեղեկացնում ենք.<br />\r\n<br />\r\nԱշխատանքային օրենսգրքի 107-րդ հոդվածի 1-ին եւ 2-րդ մասերի համաձայն՝<br />\r\n<br />\r\n- ոչ աշխատողի մեղքով պարապուրդը աշխատավայրում ստեղծված այն իրավիճակն է, որի ժամանակ գործատուն՝ արտադրական կամ օբյեկտիվ այլ պատճառներով պայմանավորված, չի կարողանում ապահովել աշխատողի` աշխատանքային պայմանագրով նախատեսված աշխատանքը,<br />\r\n<br />\r\n- պարապուրդի ժամանակ գործատուն իրավունք ունի աշխատողին՝ նրա գրավոր համաձայնությամբ, փոխադրելու ցանկացած այլ աշխատանքի` հաշվի առնելով աշխատողի մասնագիտությունը, որակավորումը եւ առողջական վիճակը: Աշխատողի համաձայնությամբ՝ նա կարող է փոխադրվել նաեւ այլ աշխատանքի` առանց հաշվի առնելու նրա մասնագիտությունը եւ որակավորումը:<br />\r\n<br />\r\nՄյուս կողմից, Աշխատանքային օրենսգրքի 186-րդ հոդվածի 1-ին մասի համաձայն, եթե ոչ աշխատողի մեղքով պարապուրդի ժամանակ աշխատողին չի առաջարկվում նրա մասնագիտությանը, որակավորմանը համապատասխանող այլ աշխատանք, որը նա կարող էր կատարել՝ առանց իր առողջությանը վնաս պատճառելու, ապա աշխատողին պարապուրդի յուրաքանչյուր ժամվա համար վճարվում է մինչեւ պարապուրդը նրա միջին ժամային աշխատավարձի երկու երրորդի չափով, սակայն ոչ պակաս, քան օրենսդրությամբ սահմանված նվազագույն ժամային դրույքաչափը:<br />\r\n<br />\r\nՆույն հոդվածի 6-րդ մասի համաձայն՝ Հայաստանի Հանրապետության օրենսդրությամբ սահմանված կարգով անհաղթահարելի ուժ համարվող պատճառներով առաջացած պարապուրդի համար չի վճարվում:<br />\r\n<br />\r\nՎերջին օրերի զարգացումները ցույց են տալիս, որ գործատուների մի մասը առաջնորդվում է Աշխատանքային օրենսգրքի 186-րդ հոդվածի 1-ին մասի կարգավորմամբ եւ վճարում իր աշխատողներին, մի մասն էլ՝ նույն հոդվածի 6-րդ մասով՝ ընդհանրապես չվճարելով:<br />\r\n<br />\r\nԱկնհայտ է, որ ստեղծված իրավիճակում անհրաժեշտ է ցուցաբերել մեկ միասնական մոտեցում՝ ապագայում հնարավոր աշխատանքային վեճերից խուսափելու եւ խնդիրները դատական կարգով չլուծելու համար:<br />\r\n<br />\r\nԱյս եւ ՀՀ-ում արտակարգ դրություն հայտարարված լինելու հանգամանքով պայմանավորված՝ Աշխատանքային օրենսգրքի մի շարք այլ կարգավորումներում եւս որոշակի լրացումներ կատարելու նպատակով՝ Աշխատանքի եւ սոցիալական հարցերի նախարարության կողմից մշակվել եւ հրատապ ռեժիմով շրջանառության է դրվել Աշխատանքային օրենսգրքում համապատասխան փոփոխություններ կատարելու նախագիծ: Մասնավորապես նախագծով առաջարկվում է՝<br />\r\n<br />\r\n- հեռավար եղանակով աշխատանքների կազմակերպման հնարավորության պարագայում, աշխատողներին չհամարել պարապուրդի մեջ, եւ աշխատավարձն ամբողջությամբ պահպանել,<br />\r\n<br />\r\n- հեռավար եղանակով աշխատանքերի կազմակերպումը եւ աշխատանքի ու հանգստի ռեժիմի փոփոխությունը չհամարել աշխատանքային պայմանագրի էական պայմանի փոփոխություն, ինչը հնարավորություն կտա գործատուներին լինել ավելի ճկուն եւ նախապես չծանուցել այդ փոփոխությունների մասին,<br />\r\n<br />\r\n- այն դեպքերում, երբ&nbsp;<strong>մասնավոր ոլորտի գործատուն</strong>, արտակարգ դրությամբ պայմանավորված, չկարողանա այլեւս աշխատանքները շարունակել, այդ թվում հեռավար եղանակով, այնուամենայնիվ շարունակի վարձատրել աշխատողին՝ չաշխատած յուրաքանչյուր ժամի համար՝ առնվազն օրենսդրությամբ սահմանված նվազագույն ժամային դրույքաչափով։ Պետական եւ համայնքային բյուջեներից ֆինանսավորվող կազմակերպությունների, ինչպես նաեւ Հայաստանի Հանրապետության կենտրոնական բանկի աշխատողների աշխատավարձն ամբողջությամբ պահպանվում է։<br />\r\n<br />\r\n- այն դեպքերում, երբ աշխատողն ունի չօգտագործված արձակուրդ, եւ հնարավոր չէ շարունակել աշխատանքները արտակարգ դրության ժամանակահատվածում, գործատուի համար նախատեսել պարտադիր պահանջ, որ աշխատողի ցանկության դեպքում վերջինիս տրամադրի իր չօգտագործված արձակուրդը,</p>\r\n\r\n<p>- այն դեպքերում, երբ արտակարգ դրությամբ պայմանավորված, աշխատողն օբյեկտիվորեն հնարավորություն չի ունեցել ներկայանալու աշխատանքի կամ աշխատանքի է ներկայացել ուշացումով կամ ոչ լրիվ աշխատանքային օրով, արգելել գործատուին իր նախաձեռնությամբ լուծելու աշխատանքային պայմանագիրը կամ կիրառել կարգապահական տույժ։ Այս դեպքերում, նախատեսել վարձատրություն առնվազն աշխատողի փաստացի աշխատած ժամանակին կամ կատարված փաստացի աշխատանքին համապատասխան։<br />\r\n<br />\r\n- այն դեպքերում, երբ ուսումնական (այդ թվում՝ նախադպրոցական) հաստատությունների համար նախատեսված արձակուրդների՝ չպլանավորված տեղափոխման կամ տրամադրման ժամանակահատվածում, երեխայի խնամքը կազմակերպելու նպատակով՝ աշխատողը աշխատանքի է ներկայացել ուշացումով կամ ոչ լրիվ աշխատանքային օրով, արգելել գործատուին իր նախաձեռնությամբ լուծելու աշխատանքային պայմանագիրը կամ կիրառել կարգապահական տույժ։ Այս դեպքերում, նախատեսել ամբողջական վարձատրություն։<br />\r\n<br />\r\n- նախատեսել դրույթ, որ արտակարգ դրության ժամանակ արտաժամյա աշխատանքը իրար հաջորդող երկու օրվա ընթացքում կարող է կազմել մինչեւ 8 ժամ՝ ներկայիս 4-ի փոխարեն,<br />\r\n<br />\r\n- անցումային դրույթներով նախատեսվելու է նաեւ, որ վերը թվարկված կարգավորումները տարածվելու են գործատուների եւ աշխատողների վրա սկսած 2020 թվականի մարտի 16-ից, երբ հայտարարվեց արտակարգ դրություն:<br />\r\n<br />\r\nՀարկ է նշել, որ Նախագծով ներկայացված մի շարք առաջարկներ բխում են աշխատանքային օրենսգրքի հիմնական սկզբունքներից (3-րդ հոդված), մասնավորապես՝<br />\r\n<br />\r\n- յուրաքանչյուր աշխատողի համար աշխատանքի արդարացի պայմանների իրավունքի ապահովումը,<br />\r\n<br />\r\n- յուրաքանչյուր աշխատողի` ժամանակին եւ ամբողջությամբ աշխատանքի արդարացի վարձատրության իրավունքի ապահովումը` օրենքով սահմանված նվազագույն աշխատավարձի չափից ոչ ցածր:<br />\r\n<br />\r\nՄիաժամանակ, անդրադառնալով վերջին օրերին հնչած այն տեսակետին, որ հեռավար եղանակով աշխատանքների կազմակերպման մասով Աշխատանքային օրենսգրքում փոփոխություններ կատարելու անհրաժեշտությունը բացակայում է, քանի որ տնաշխատների՝ աշխատանքի եւ վարձատրության հետ կապված հարաբերություններն արդեն իսկ կարգավորված են Աշխատանքային օրենսգրքով, մասնավորապես 98-րդ հոդվածով, տեղեկացնում ենք, որ գործող կարգավորմամբ՝ աշխատանքի վայրը համարվում է աշխատանքային պայմանագրի էական պայման, որի փոփոխման դեպքում գործատուն պարտավոր է նախապես ծանուցել աշխատողին կախված նրա ստաժից համապատասխան օր առաջ (Աշխատանքային օրենսգրքի 115-րդ հոդվածի 1-ին մաս): Հաշվի առնելով, որ արտակարգ դրության պայմաններում գործատուն պետք է արագ արձագանքի ստեղծված մարտահրավերներին եւ հնարավորության դեպքում աշխատանքները կազմակերպի հեռավար եղանակով, նախագծով առաջարկվում է, որ այս իրավիճակում հեռավար եղանակով աշխատանքների կազմակերպումը չհամարվի աշխատանքի վայրի փոփոխություն:<br />\r\n<br />\r\nԻնչ վերաբերվում է հեռավար աշխատանքի՝ Աշխատանքային օրենսգրքի 98-րդ հոդվածով արդեն իսկ կարգավորված լինելուն, ապա նշենք, որ այդ հոդվածը վերաբերում է այն դեպքերին, երբ ի սկզբանե, աշխատանքի բնույթից ելնելով, գործատուի եւ աշխատողի միջեւ կնքվել է աշխատանքային պայմանագիր աշխատանքները տանից կատարելու վերաբերյալ:<br />\r\n<br />\r\nԱրտակարգ դրության պայմաններում ոչ թե կնքվում է աշխատանքային պայմանագիր՝ աշխատանքները հեռավար իրականացնելու համար, այլ ուղղակի փոփոխվում է աշխատանքի վայրը: Հետեւաբար՝ ճիշտ չէ որեւէ կերպ նույնականացնել տնաշխատների համար նախատեսված կարգավորումը՝ հեռավար եղանակով աշխատանք կատարելու կարգավորման հետ:<br />\r\n<br />\r\nՄիաժամանակ տեղեկացնում ենք, որ Աշխատանքի եւ սոցիալական հարցերի նախարարությունը աշխատողի եւ գործատուի միջեւ ծագած խնդիրնեըը իրավասու է լուծելու համապատասխան օրենսդրական կարգավորումներ մշակելու եւ պարզաբանումներ տրամադրելու շրջանակներում միայն: Նախարարությունը, իր լիազորութունների շրջանակներում, աշխատողի եւ գործատուի աշխատանքային հարաբերութուններին միջամտելու իրավասություն չունի:</p>\r\n', '<p>Հաշվի առնելով, որ 2020 թ.-ի մարտի 16-ից ՀՀ-ում հայտարարված արտակարգ դրությունը մի շարք հարցեր է առաջացրել տվյալ իրավիճակում աշխատանքային օրենսդրության առկա կարգավորումների, ինչպես նաեւ Աշխատանքի եւ սոցիալական հարցերի նախարարության կողմից առկա բացերի լրացման նպատակով իրականացվող միջոցառումների վերաբերյալ, տեղեկացնում ենք.<br />\r\n<br />\r\nԱշխատանքային օրենսգրքի 107-րդ հոդվածի 1-ին եւ 2-րդ մասերի համաձայն՝<br />\r\n<br />\r\n- ոչ աշխատողի մեղքով պարապուրդը աշխատավայրում ստեղծված այն իրավիճակն է, որի ժամանակ գործատուն՝ արտադրական կամ օբյեկտիվ այլ պատճառներով պայմանավորված, չի կարողանում ապահովել աշխատողի` աշխատանքային պայմանագրով նախատեսված աշխատանքը,<br />\r\n<br />\r\n- պարապուրդի ժամանակ գործատուն իրավունք ունի աշխատողին՝ նրա գրավոր համաձայնությամբ, փոխադրելու ցանկացած այլ աշխատանքի` հաշվի առնելով աշխատողի մասնագիտությունը, որակավորումը եւ առողջական վիճակը: Աշխատողի համաձայնությամբ՝ նա կարող է փոխադրվել նաեւ այլ աշխատանքի` առանց հաշվի առնելու նրա մասնագիտությունը եւ որակավորումը:<br />\r\n<br />\r\nՄյուս կողմից, Աշխատանքային օրենսգրքի 186-րդ հոդվածի 1-ին մասի համաձայն, եթե ոչ աշխատողի մեղքով պարապուրդի ժամանակ աշխատողին չի առաջարկվում նրա մասնագիտությանը, որակավորմանը համապատասխանող այլ աշխատանք, որը նա կարող էր կատարել՝ առանց իր առողջությանը վնաս պատճառելու, ապա աշխատողին պարապուրդի յուրաքանչյուր ժամվա համար վճարվում է մինչեւ պարապուրդը նրա միջին ժամային աշխատավարձի երկու երրորդի չափով, սակայն ոչ պակաս, քան օրենսդրությամբ սահմանված նվազագույն ժամային դրույքաչափը:<br />\r\n<br />\r\nՆույն հոդվածի 6-րդ մասի համաձայն՝ Հայաստանի Հանրապետության օրենսդրությամբ սահմանված կարգով անհաղթահարելի ուժ համարվող պատճառներով առաջացած պարապուրդի համար չի վճարվում:<br />\r\n<br />\r\nՎերջին օրերի զարգացումները ցույց են տալիս, որ գործատուների մի մասը առաջնորդվում է Աշխատանքային օրենսգրքի 186-րդ հոդվածի 1-ին մասի կարգավորմամբ եւ վճարում իր աշխատողներին, մի մասն էլ՝ նույն հոդվածի 6-րդ մասով՝ ընդհանրապես չվճարելով:<br />\r\n<br />\r\nԱկնհայտ է, որ ստեղծված իրավիճակում անհրաժեշտ է ցուցաբերել մեկ միասնական մոտեցում՝ ապագայում հնարավոր աշխատանքային վեճերից խուսափելու եւ խնդիրները դատական կարգով չլուծելու համար:<br />\r\n<br />\r\nԱյս եւ ՀՀ-ում արտակարգ դրություն հայտարարված լինելու հանգամանքով պայմանավորված՝ Աշխատանքային օրենսգրքի մի շարք այլ կարգավորումներում եւս որոշակի լրացումներ կատարելու նպատակով՝ Աշխատանքի եւ սոցիալական հարցերի նախարարության կողմից մշակվել եւ հրատապ ռեժիմով շրջանառության է դրվել Աշխատանքային օրենսգրքում համապատասխան փոփոխություններ կատարելու նախագիծ: Մասնավորապես նախագծով առաջարկվում է՝<br />\r\n<br />\r\n- հեռավար եղանակով աշխատանքների կազմակերպման հնարավորության պարագայում, աշխատողներին չհամարել պարապուրդի մեջ, եւ աշխատավարձն ամբողջությամբ պահպանել,<br />\r\n<br />\r\n- հեռավար եղանակով աշխատանքերի կազմակերպումը եւ աշխատանքի ու հանգստի ռեժիմի փոփոխությունը չհամարել աշխատանքային պայմանագրի էական պայմանի փոփոխություն, ինչը հնարավորություն կտա գործատուներին լինել ավելի ճկուն եւ նախապես չծանուցել այդ փոփոխությունների մասին,<br />\r\n<br />\r\n- այն դեպքերում, երբ&nbsp;<strong>մասնավոր ոլորտի գործատուն</strong>, արտակարգ դրությամբ պայմանավորված, չկարողանա այլեւս աշխատանքները շարունակել, այդ թվում հեռավար եղանակով, այնուամենայնիվ շարունակի վարձատրել աշխատողին՝ չաշխատած յուրաքանչյուր ժամի համար՝ առնվազն օրենսդրությամբ սահմանված նվազագույն ժամային դրույքաչափով։ Պետական եւ համայնքային բյուջեներից ֆինանսավորվող կազմակերպությունների, ինչպես նաեւ Հայաստանի Հանրապետության կենտրոնական բանկի աշխատողների աշխատավարձն ամբողջությամբ պահպանվում է։<br />\r\n<br />\r\n- այն դեպքերում, երբ աշխատողն ունի չօգտագործված արձակուրդ, եւ հնարավոր չէ շարունակել աշխատանքները արտակարգ դրության ժամանակահատվածում, գործատուի համար նախատեսել պարտադիր պահանջ, որ աշխատողի ցանկության դեպքում վերջինիս տրամադրի իր չօգտագործված արձակուրդը,</p>\r\n\r\n<p>- այն դեպքերում, երբ արտակարգ դրությամբ պայմանավորված, աշխատողն օբյեկտիվորեն հնարավորություն չի ունեցել ներկայանալու աշխատանքի կամ աշխատանքի է ներկայացել ուշացումով կամ ոչ լրիվ աշխատանքային օրով, արգելել գործատուին իր նախաձեռնությամբ լուծելու աշխատանքային պայմանագիրը կամ կիրառել կարգապահական տույժ։ Այս դեպքերում, նախատեսել վարձատրություն առնվազն աշխատողի փաստացի աշխատած ժամանակին կամ կատարված փաստացի աշխատանքին համապատասխան։<br />\r\n<br />\r\n- այն դեպքերում, երբ ուսումնական (այդ թվում՝ նախադպրոցական) հաստատությունների համար նախատեսված արձակուրդների՝ չպլանավորված տեղափոխման կամ տրամադրման ժամանակահատվածում, երեխայի խնամքը կազմակերպելու նպատակով՝ աշխատողը աշխատանքի է ներկայացել ուշացումով կամ ոչ լրիվ աշխատանքային օրով, արգելել գործատուին իր նախաձեռնությամբ լուծելու աշխատանքային պայմանագիրը կամ կիրառել կարգապահական տույժ։ Այս դեպքերում, նախատեսել ամբողջական վարձատրություն։<br />\r\n<br />\r\n- նախատեսել դրույթ, որ արտակարգ դրության ժամանակ արտաժամյա աշխատանքը իրար հաջորդող երկու օրվա ընթացքում կարող է կազմել մինչեւ 8 ժամ՝ ներկայիս 4-ի փոխարեն,<br />\r\n<br />\r\n- անցումային դրույթներով նախատեսվելու է նաեւ, որ վերը թվարկված կարգավորումները տարածվելու են գործատուների եւ աշխատողների վրա սկսած 2020 թվականի մարտի 16-ից, երբ հայտարարվեց արտակարգ դրություն:<br />\r\n<br />\r\nՀարկ է նշել, որ Նախագծով ներկայացված մի շարք առաջարկներ բխում են աշխատանքային օրենսգրքի հիմնական սկզբունքներից (3-րդ հոդված), մասնավորապես՝<br />\r\n<br />\r\n- յուրաքանչյուր աշխատողի համար աշխատանքի արդարացի պայմանների իրավունքի ապահովումը,<br />\r\n<br />\r\n- յուրաքանչյուր աշխատողի` ժամանակին եւ ամբողջությամբ աշխատանքի արդարացի վարձատրության իրավունքի ապահովումը` օրենքով սահմանված նվազագույն աշխատավարձի չափից ոչ ցածր:<br />\r\n<br />\r\nՄիաժամանակ, անդրադառնալով վերջին օրերին հնչած այն տեսակետին, որ հեռավար եղանակով աշխատանքների կազմակերպման մասով Աշխատանքային օրենսգրքում փոփոխություններ կատարելու անհրաժեշտությունը բացակայում է, քանի որ տնաշխատների՝ աշխատանքի եւ վարձատրության հետ կապված հարաբերություններն արդեն իսկ կարգավորված են Աշխատանքային օրենսգրքով, մասնավորապես 98-րդ հոդվածով, տեղեկացնում ենք, որ գործող կարգավորմամբ՝ աշխատանքի վայրը համարվում է աշխատանքային պայմանագրի էական պայման, որի փոփոխման դեպքում գործատուն պարտավոր է նախապես ծանուցել աշխատողին կախված նրա ստաժից համապատասխան օր առաջ (Աշխատանքային օրենսգրքի 115-րդ հոդվածի 1-ին մաս): Հաշվի առնելով, որ արտակարգ դրության պայմաններում գործատուն պետք է արագ արձագանքի ստեղծված մարտահրավերներին եւ հնարավորության դեպքում աշխատանքները կազմակերպի հեռավար եղանակով, նախագծով առաջարկվում է, որ այս իրավիճակում հեռավար եղանակով աշխատանքների կազմակերպումը չհամարվի աշխատանքի վայրի փոփոխություն:<br />\r\n<br />\r\nԻնչ վերաբերվում է հեռավար աշխատանքի՝ Աշխատանքային օրենսգրքի 98-րդ հոդվածով արդեն իսկ կարգավորված լինելուն, ապա նշենք, որ այդ հոդվածը վերաբերում է այն դեպքերին, երբ ի սկզբանե, աշխատանքի բնույթից ելնելով, գործատուի եւ աշխատողի միջեւ կնքվել է աշխատանքային պայմանագիր աշխատանքները տանից կատարելու վերաբերյալ:<br />\r\n<br />\r\nԱրտակարգ դրության պայմաններում ոչ թե կնքվում է աշխատանքային պայմանագիր՝ աշխատանքները հեռավար իրականացնելու համար, այլ ուղղակի փոփոխվում է աշխատանքի վայրը: Հետեւաբար՝ ճիշտ չէ որեւէ կերպ նույնականացնել տնաշխատների համար նախատեսված կարգավորումը՝ հեռավար եղանակով աշխատանք կատարելու կարգավորման հետ:<br />\r\n<br />\r\nՄիաժամանակ տեղեկացնում ենք, որ Աշխատանքի եւ սոցիալական հարցերի նախարարությունը աշխատողի եւ գործատուի միջեւ ծագած խնդիրնեըը իրավասու է լուծելու համապատասխան օրենսդրական կարգավորումներ մշակելու եւ պարզաբանումներ տրամադրելու շրջանակներում միայն: Նախարարությունը, իր լիազորութունների շրջանակներում, աշխատողի եւ գործատուի աշխատանքային հարաբերութուններին միջամտելու իրավասություն չունի:</p>\r\n', 'http://www.oferta.am/uploadBlog/Artakarg iravichak.png', '2020-03-22 00:00:00');
INSERT INTO `userfularticlescontroller` VALUES (12, 'ՀԲ-ն կաջակցի հետագա սոցիալական ներդրումներին ՀՀ 55 համայնքներում', 'ՀԲ-ն կաջակցի հետագա սոցիալական ներդրումներին ՀՀ 55 համայնքներում', 'ՀԲ-ն կաջակցի հետագա սոցիալական ներդրումներին ՀՀ 55 համայնքներում', '<p>Ծրագիրը կօգնի ՀՀ կառավարությանը՝ համայնքային եւ միջհամայնքային ենթակառուցվածքների ու ծառայությունների որակը, հասանելիությունը եւ կիրառելիությունը բարելավելու գործում։<br />\r\n<br />\r\nԱջակցելով միջհամայնքային երկխոսության կայացմանը՝ Լրացուցիչ ֆինանսավորման ենթածրագրերի միջոցով ֆինանսավորելու են հանրային սեփականություն հանդիսացող ենթակառուցվածքները եւ ծառայությունները՝ մարզերի կամ համայնքների խմբերի սոցիալ-տնտեսական եւ մարդկային կապիտալի զարգացումը բարելավելու նպատակով։<br />\r\n<br />\r\nԾրագիրը թույլ է տալու Հայաստանի համայնքների բնակչությանը միկրո ծրագրերի միջոցով օգտվել վերանորոգված ու վերականգնված սոցիալական ենթակառուցվածքներից՝ մանկապարտեզներում, դպրոցներում, ջրամատակարարման եւ ջրահեռացման համակարգերում, համայնքային կենտրոններում, բուժհաստատություններում, փոքր ոռոգման համակարգերում եւ տեղական այլ ենթակառուցվածքներում։ Դրանք ընտրվելու են համայնքի խոցելիության աստիճանի եւ ներկայացված ենթածրագրային հայտերի պոտենցիալ սոցիալ-տնտեսական ազդեցության գնահատականի հիման վրա։<br />\r\n<br />\r\n&laquo;Նոր ծրագրից անմիջականորեն օգտվելու են մոտավորապես 55 համայնքներ, որոնցից 35-ը վերջերս խոշորացված համայնքներ են՝ հիմնականում գյուղական շրջաններում, եւ նրանք հնարավորություն կունենան վերհանելու իրենց ներդրումային կարիքները&raquo;, - նշել է Համաշխարհային բանկի Հայաստանի գրասենյակի ղեկավար Սիլվի Բոսութղոն։<br />\r\n&laquo;Ես հատկապես ուրախ եմ, որ այս ծրագիրը նաեւ փորձելու է նպաստել համայնքներում եկամտաբեր գործունեությանը, որը կարող է տնտեսական հնարավորություններ բացել&raquo;,- ասել է նա։<br />\r\n<br />\r\nԾրագիրն ունի երեք բաղադրիչ։ Առաջին բաղադրիչով աջակցություն է տրամադրվում համայնքների սոցիալ-տնտեսական զարգացմանն ու կարողությունների ձեւավորմանը։ Լրացուցիչ ֆինանսավորմամբ շարունակվելու է այն միկրո ծրագրերի ֆինանսավորումը, որոնք հասցեագրված են 20 խոցելի համայնքներին՝ համայնքի բազային ենթակառուցվածքների առաջնահերթ կարիքները հասցեագրելու նպատակով։<br />\r\n<br />\r\nԵրկրորդ՝ սոցիալական եւ տնտեսական զարգացման միջհամայնքային նախաձեռնություններ բաղադրիչով ֆինանսավորվելու է 35 նախաձեռնություն, որոնք կունենան ավելի երկարաժամկետ զարգացման ազդեցություն՝ համախմբելով երկու կամ ավելի համայնքներ։ Համագործակցային զարգացման այս նոր մոտեցմամբ լրացուցիչ խթաններ են տրամադրվելու համայնքներին՝ տարածքային բարեփոխումների հայեցակարգին համապատասխան զարգացման կապերն ու հնարավորությունները լիարժեք օգտագործելու նպատակով։<br />\r\n<br />\r\nԵրրորդ բաղադրիչով աջակցություն է տրամադրվելու Հայաստանի տարածքային զարգացման հիմնադրամի (ՀՏԶՀ) ինստիտուցիոնալ հզորացմանը։ Տարածքային բարեփոխումներին համապատասխան՝ ՀՏԶՀ-ն աստիճանաբար անցում է կատարում հիմնականում սոցիալական ենթակառուցվածքին վերաբերող միկրո ծրագրերից դեպի կայուն տարածքային զարգացման ծրագրերի իրականացման խոշորացված համայնքների կողմից։<br />\r\n<br />\r\n&laquo;Գործառնական կարգավորումներն ու ընթացակարգերը կկատարելագործվեն՝ հզորացնելով համայնքի ներգրավվածությունն ու մասնակցությունը&raquo;, - նշել է Համաշխարհային բանկի ծրագրի թիմի ղեկավար Իվան Դրաբեկը։<br />\r\n<br />\r\n&laquo;Ավելին, քաղաքացիական մասնակցության շրջանակը պետք է հզորացնել շահառուների կարծիքն ավելի լավ ներկայացնող ու չափորոշող գործիքների կիրառմամբ։ Եվ վերջիվերջո, գենդերային տարբերությունները կպարզվեն ու կհասցեագրվեն՝ ապահովելով տեղական մակարդակում որոշումների կայացման գործընթացներում կանանց ավելի ուժեղ մասնակցություն&raquo;,-ասել է նա։<br />\r\n<br />\r\n17.9 մլն եվրոն (20 մլն դոլարի համարժեք) ՎԶՄԲ վարկ է, որն ունի փոփոխական սպրեդ, 14.5 տարի անտոկոս ժամանակահատված եւ 25.5 տարի ընդհանուր մարման ժամկետ։ ՀՀ կառավարությունը եւ շահառու համայնքները տրամադրելու են ընդհանուր 7.52 միլիոն եվրո գումարի համաֆինանսավորում։<br />\r\n<br />\r\n1992 թ. Համաշխարհային բանկին եւ 1993 թ.Միջազգային զարգացման ընկերակցությանը միանալուց ի վեր՝ Հայաստանի ընդհանուր պարտավորության չափը կազմել է մոտավորապես 2,434,734 մլն դոլար։</p>\r\n', '<p>Ծրագիրը կօգնի ՀՀ կառավարությանը՝ համայնքային եւ միջհամայնքային ենթակառուցվածքների ու ծառայությունների որակը, հասանելիությունը եւ կիրառելիությունը բարելավելու գործում։<br />\r\n<br />\r\nԱջակցելով միջհամայնքային երկխոսության կայացմանը՝ Լրացուցիչ ֆինանսավորման ենթածրագրերի միջոցով ֆինանսավորելու են հանրային սեփականություն հանդիսացող ենթակառուցվածքները եւ ծառայությունները՝ մարզերի կամ համայնքների խմբերի սոցիալ-տնտեսական եւ մարդկային կապիտալի զարգացումը բարելավելու նպատակով։<br />\r\n<br />\r\nԾրագիրը թույլ է տալու Հայաստանի համայնքների բնակչությանը միկրո ծրագրերի միջոցով օգտվել վերանորոգված ու վերականգնված սոցիալական ենթակառուցվածքներից՝ մանկապարտեզներում, դպրոցներում, ջրամատակարարման եւ ջրահեռացման համակարգերում, համայնքային կենտրոններում, բուժհաստատություններում, փոքր ոռոգման համակարգերում եւ տեղական այլ ենթակառուցվածքներում։ Դրանք ընտրվելու են համայնքի խոցելիության աստիճանի եւ ներկայացված ենթածրագրային հայտերի պոտենցիալ սոցիալ-տնտեսական ազդեցության գնահատականի հիման վրա։<br />\r\n<br />\r\n&laquo;Նոր ծրագրից անմիջականորեն օգտվելու են մոտավորապես 55 համայնքներ, որոնցից 35-ը վերջերս խոշորացված համայնքներ են՝ հիմնականում գյուղական շրջաններում, եւ նրանք հնարավորություն կունենան վերհանելու իրենց ներդրումային կարիքները&raquo;, - նշել է Համաշխարհային բանկի Հայաստանի գրասենյակի ղեկավար Սիլվի Բոսութղոն։<br />\r\n&laquo;Ես հատկապես ուրախ եմ, որ այս ծրագիրը նաեւ փորձելու է նպաստել համայնքներում եկամտաբեր գործունեությանը, որը կարող է տնտեսական հնարավորություններ բացել&raquo;,- ասել է նա։<br />\r\n<br />\r\nԾրագիրն ունի երեք բաղադրիչ։ Առաջին բաղադրիչով աջակցություն է տրամադրվում համայնքների սոցիալ-տնտեսական զարգացմանն ու կարողությունների ձեւավորմանը։ Լրացուցիչ ֆինանսավորմամբ շարունակվելու է այն միկրո ծրագրերի ֆինանսավորումը, որոնք հասցեագրված են 20 խոցելի համայնքներին՝ համայնքի բազային ենթակառուցվածքների առաջնահերթ կարիքները հասցեագրելու նպատակով։<br />\r\n<br />\r\nԵրկրորդ՝ սոցիալական եւ տնտեսական զարգացման միջհամայնքային նախաձեռնություններ բաղադրիչով ֆինանսավորվելու է 35 նախաձեռնություն, որոնք կունենան ավելի երկարաժամկետ զարգացման ազդեցություն՝ համախմբելով երկու կամ ավելի համայնքներ։ Համագործակցային զարգացման այս նոր մոտեցմամբ լրացուցիչ խթաններ են տրամադրվելու համայնքներին՝ տարածքային բարեփոխումների հայեցակարգին համապատասխան զարգացման կապերն ու հնարավորությունները լիարժեք օգտագործելու նպատակով։<br />\r\n<br />\r\nԵրրորդ բաղադրիչով աջակցություն է տրամադրվելու Հայաստանի տարածքային զարգացման հիմնադրամի (ՀՏԶՀ) ինստիտուցիոնալ հզորացմանը։ Տարածքային բարեփոխումներին համապատասխան՝ ՀՏԶՀ-ն աստիճանաբար անցում է կատարում հիմնականում սոցիալական ենթակառուցվածքին վերաբերող միկրո ծրագրերից դեպի կայուն տարածքային զարգացման ծրագրերի իրականացման խոշորացված համայնքների կողմից։<br />\r\n<br />\r\n&laquo;Գործառնական կարգավորումներն ու ընթացակարգերը կկատարելագործվեն՝ հզորացնելով համայնքի ներգրավվածությունն ու մասնակցությունը&raquo;, - նշել է Համաշխարհային բանկի ծրագրի թիմի ղեկավար Իվան Դրաբեկը։<br />\r\n<br />\r\n&laquo;Ավելին, քաղաքացիական մասնակցության շրջանակը պետք է հզորացնել շահառուների կարծիքն ավելի լավ ներկայացնող ու չափորոշող գործիքների կիրառմամբ։ Եվ վերջիվերջո, գենդերային տարբերությունները կպարզվեն ու կհասցեագրվեն՝ ապահովելով տեղական մակարդակում որոշումների կայացման գործընթացներում կանանց ավելի ուժեղ մասնակցություն&raquo;,-ասել է նա։<br />\r\n<br />\r\n17.9 մլն եվրոն (20 մլն դոլարի համարժեք) ՎԶՄԲ վարկ է, որն ունի փոփոխական սպրեդ, 14.5 տարի անտոկոս ժամանակահատված եւ 25.5 տարի ընդհանուր մարման ժամկետ։ ՀՀ կառավարությունը եւ շահառու համայնքները տրամադրելու են ընդհանուր 7.52 միլիոն եվրո գումարի համաֆինանսավորում։<br />\r\n<br />\r\n1992 թ. Համաշխարհային բանկին եւ 1993 թ.Միջազգային զարգացման ընկերակցությանը միանալուց ի վեր՝ Հայաստանի ընդհանուր պարտավորության չափը կազմել է մոտավորապես 2,434,734 մլն դոլար։</p>\r\n', '<p>Ծրագիրը կօգնի ՀՀ կառավարությանը՝ համայնքային եւ միջհամայնքային ենթակառուցվածքների ու ծառայությունների որակը, հասանելիությունը եւ կիրառելիությունը բարելավելու գործում։<br />\r\n<br />\r\nԱջակցելով միջհամայնքային երկխոսության կայացմանը՝ Լրացուցիչ ֆինանսավորման ենթածրագրերի միջոցով ֆինանսավորելու են հանրային սեփականություն հանդիսացող ենթակառուցվածքները եւ ծառայությունները՝ մարզերի կամ համայնքների խմբերի սոցիալ-տնտեսական եւ մարդկային կապիտալի զարգացումը բարելավելու նպատակով։<br />\r\n<br />\r\nԾրագիրը թույլ է տալու Հայաստանի համայնքների բնակչությանը միկրո ծրագրերի միջոցով օգտվել վերանորոգված ու վերականգնված սոցիալական ենթակառուցվածքներից՝ մանկապարտեզներում, դպրոցներում, ջրամատակարարման եւ ջրահեռացման համակարգերում, համայնքային կենտրոններում, բուժհաստատություններում, փոքր ոռոգման համակարգերում եւ տեղական այլ ենթակառուցվածքներում։ Դրանք ընտրվելու են համայնքի խոցելիության աստիճանի եւ ներկայացված ենթածրագրային հայտերի պոտենցիալ սոցիալ-տնտեսական ազդեցության գնահատականի հիման վրա։<br />\r\n<br />\r\n&laquo;Նոր ծրագրից անմիջականորեն օգտվելու են մոտավորապես 55 համայնքներ, որոնցից 35-ը վերջերս խոշորացված համայնքներ են՝ հիմնականում գյուղական շրջաններում, եւ նրանք հնարավորություն կունենան վերհանելու իրենց ներդրումային կարիքները&raquo;, - նշել է Համաշխարհային բանկի Հայաստանի գրասենյակի ղեկավար Սիլվի Բոսութղոն։<br />\r\n&laquo;Ես հատկապես ուրախ եմ, որ այս ծրագիրը նաեւ փորձելու է նպաստել համայնքներում եկամտաբեր գործունեությանը, որը կարող է տնտեսական հնարավորություններ բացել&raquo;,- ասել է նա։<br />\r\n<br />\r\nԾրագիրն ունի երեք բաղադրիչ։ Առաջին բաղադրիչով աջակցություն է տրամադրվում համայնքների սոցիալ-տնտեսական զարգացմանն ու կարողությունների ձեւավորմանը։ Լրացուցիչ ֆինանսավորմամբ շարունակվելու է այն միկրո ծրագրերի ֆինանսավորումը, որոնք հասցեագրված են 20 խոցելի համայնքներին՝ համայնքի բազային ենթակառուցվածքների առաջնահերթ կարիքները հասցեագրելու նպատակով։<br />\r\n<br />\r\nԵրկրորդ՝ սոցիալական եւ տնտեսական զարգացման միջհամայնքային նախաձեռնություններ բաղադրիչով ֆինանսավորվելու է 35 նախաձեռնություն, որոնք կունենան ավելի երկարաժամկետ զարգացման ազդեցություն՝ համախմբելով երկու կամ ավելի համայնքներ։ Համագործակցային զարգացման այս նոր մոտեցմամբ լրացուցիչ խթաններ են տրամադրվելու համայնքներին՝ տարածքային բարեփոխումների հայեցակարգին համապատասխան զարգացման կապերն ու հնարավորությունները լիարժեք օգտագործելու նպատակով։<br />\r\n<br />\r\nԵրրորդ բաղադրիչով աջակցություն է տրամադրվելու Հայաստանի տարածքային զարգացման հիմնադրամի (ՀՏԶՀ) ինստիտուցիոնալ հզորացմանը։ Տարածքային բարեփոխումներին համապատասխան՝ ՀՏԶՀ-ն աստիճանաբար անցում է կատարում հիմնականում սոցիալական ենթակառուցվածքին վերաբերող միկրո ծրագրերից դեպի կայուն տարածքային զարգացման ծրագրերի իրականացման խոշորացված համայնքների կողմից։<br />\r\n<br />\r\n&laquo;Գործառնական կարգավորումներն ու ընթացակարգերը կկատարելագործվեն՝ հզորացնելով համայնքի ներգրավվածությունն ու մասնակցությունը&raquo;, - նշել է Համաշխարհային բանկի ծրագրի թիմի ղեկավար Իվան Դրաբեկը։<br />\r\n<br />\r\n&laquo;Ավելին, քաղաքացիական մասնակցության շրջանակը պետք է հզորացնել շահառուների կարծիքն ավելի լավ ներկայացնող ու չափորոշող գործիքների կիրառմամբ։ Եվ վերջիվերջո, գենդերային տարբերությունները կպարզվեն ու կհասցեագրվեն՝ ապահովելով տեղական մակարդակում որոշումների կայացման գործընթացներում կանանց ավելի ուժեղ մասնակցություն&raquo;,-ասել է նա։<br />\r\n<br />\r\n17.9 մլն եվրոն (20 մլն դոլարի համարժեք) ՎԶՄԲ վարկ է, որն ունի փոփոխական սպրեդ, 14.5 տարի անտոկոս ժամանակահատված եւ 25.5 տարի ընդհանուր մարման ժամկետ։ ՀՀ կառավարությունը եւ շահառու համայնքները տրամադրելու են ընդհանուր 7.52 միլիոն եվրո գումարի համաֆինանսավորում։<br />\r\n<br />\r\n1992 թ. Համաշխարհային բանկին եւ 1993 թ.Միջազգային զարգացման ընկերակցությանը միանալուց ի վեր՝ Հայաստանի ընդհանուր պարտավորության չափը կազմել է մոտավորապես 2,434,734 մլն դոլար։</p>\r\n', 'http://www.oferta.am/uploadBlog/IMF png.png', '2020-03-22 00:00:00');
INSERT INTO `userfularticlescontroller` VALUES (13, 'Evocabank. Ունեցիր քո ներդրումը COVID-19-ի դեմ պայքարում', 'Evocabank. Ունեցիր քո ներդրումը COVID-19-ի դեմ պայքարում', 'Evocabank. Ունեցիր քո ներդրումը COVID-19-ի դեմ պայքարում', '<p><strong>Evocabank-ը տեղեկացնում է, որ այսուհետ նույնիսկ առանց Evocabank-ի հաճախորդ լինելու, ցանկացած Arca, Mastercard կամ Visa քարտով EvocaTOUCH հավելվածի միջոցով կարելի է կատարել նվիրաբերություն ՀՀ տարածքում կորոնավիրուսային հիվանդության կանխարգելմանը եւ հաղթահարմանն ուղղված՝ ՀՀ ֆինանսների նախարարության կողմից բացված գանձապետական հաշվին։</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&laquo;Պարզապես անհրաժեշտ է մուտք գործել EvocaTOUCH հավելված, հենց առաջին էջից սեղմել Նվիրաբերել կոճակը եւ լրացնել տվյալները։</p>\r\n\r\n<p>Գումարը կուղղվի առողջապահության նախարարության կողմից բժշկական անձնակազմի խրախուսմանը, բժշկական պարագաների եւ սարքավորումների ձեռքբերմանը, ինչպես նաեւ բժշկական կենտրոնների շենքային պայմանների բարելավմանը։</p>\r\n\r\n<p>Նվիրաբերության վճարումները կատարվում են առանց միջնորդավճարի։</p>\r\n\r\n<p>Իսկ եթե չունես EvocaTOUCH հավելվածը, այն կարող ես ներբեռնել&nbsp;<strong><a href=\"https://onelink.to/evocabank\" target=\"_blank\">այստեղ</a></strong>&raquo;,- ասված է բանկի տարածած հաղորդագրությունում։</p>\r\n', '<p><strong>Evocabank-ը տեղեկացնում է, որ այսուհետ նույնիսկ առանց Evocabank-ի հաճախորդ լինելու, ցանկացած Arca, Mastercard կամ Visa քարտով EvocaTOUCH հավելվածի միջոցով կարելի է կատարել նվիրաբերություն ՀՀ տարածքում կորոնավիրուսային հիվանդության կանխարգելմանը եւ հաղթահարմանն ուղղված՝ ՀՀ ֆինանսների նախարարության կողմից բացված գանձապետական հաշվին։</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&laquo;Պարզապես անհրաժեշտ է մուտք գործել EvocaTOUCH հավելված, հենց առաջին էջից սեղմել Նվիրաբերել կոճակը եւ լրացնել տվյալները։</p>\r\n\r\n<p>Գումարը կուղղվի առողջապահության նախարարության կողմից բժշկական անձնակազմի խրախուսմանը, բժշկական պարագաների եւ սարքավորումների ձեռքբերմանը, ինչպես նաեւ բժշկական կենտրոնների շենքային պայմանների բարելավմանը։</p>\r\n\r\n<p>Նվիրաբերության վճարումները կատարվում են առանց միջնորդավճարի։</p>\r\n\r\n<p>Իսկ եթե չունես EvocaTOUCH հավելվածը, այն կարող ես ներբեռնել&nbsp;<strong><a href=\"https://onelink.to/evocabank\" target=\"_blank\">այստեղ</a></strong>&raquo;,- ասված է բանկի տարածած հաղորդագրությունում։</p>\r\n', '<p><strong>Evocabank-ը տեղեկացնում է, որ այսուհետ նույնիսկ առանց Evocabank-ի հաճախորդ լինելու, ցանկացած Arca, Mastercard կամ Visa քարտով EvocaTOUCH հավելվածի միջոցով կարելի է կատարել նվիրաբերություն ՀՀ տարածքում կորոնավիրուսային հիվանդության կանխարգելմանը եւ հաղթահարմանն ուղղված՝ ՀՀ ֆինանսների նախարարության կողմից բացված գանձապետական հաշվին։</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&laquo;Պարզապես անհրաժեշտ է մուտք գործել EvocaTOUCH հավելված, հենց առաջին էջից սեղմել Նվիրաբերել կոճակը եւ լրացնել տվյալները։</p>\r\n\r\n<p>Գումարը կուղղվի առողջապահության նախարարության կողմից բժշկական անձնակազմի խրախուսմանը, բժշկական պարագաների եւ սարքավորումների ձեռքբերմանը, ինչպես նաեւ բժշկական կենտրոնների շենքային պայմանների բարելավմանը։</p>\r\n\r\n<p>Նվիրաբերության վճարումները կատարվում են առանց միջնորդավճարի։</p>\r\n\r\n<p>Իսկ եթե չունես EvocaTOUCH հավելվածը, այն կարող ես ներբեռնել&nbsp;<strong><a href=\"https://onelink.to/evocabank\" target=\"_blank\">այստեղ</a></strong>&raquo;,- ասված է բանկի տարածած հաղորդագրությունում։</p>\r\n', 'http://www.oferta.am/uploadBlog/Evoca _png.png', '2020-03-22 00:00:00');
INSERT INTO `userfularticlescontroller` VALUES (15, 'Ryanair ավիաընկերությունը կորոնավիրուսի պատճառով ծրագրում է 3000 աշխատատեղ կրճատել', 'Ryanair ավիաընկերությունը կորոնավիրուսի պատճառով ծրագրում է 3000 աշխատատեղ կրճատել', 'Ryanair ավիաընկերությունը կորոնավիրուսի պատճառով ծրագրում է 3000 աշխատատեղ կրճատել', '<p>Եվրոպայի խոշորագույն ավիաընկերություններից մեկը՝ Ryanair ավիաընկերությունը, կորոնավիրուսի համավարակի պայմաններում թռիչքների կրճատման հետևանքով ծրագրում է 3000 աշխատատեղ կրճատել, աշխատակիցների աշխատավարձերն էլ իջեցնել մեկ հինգերորդով: Այս մասին տեղեկացնում է&nbsp;<a href=\"https://www.theguardian.com/world/live/2020/may/01/coronavirus-live-news-uk-is-past-the-peak-as-trump-claims-evidence-virus-started-in-wuhan-lab?fbclid=IwAR3Tngw9mE4BjKTeQKa8rn3suZuPOXnHrwKCwcBVjjY_Un_8_zKCRC3d0nQ#block-5eabc9108f08a459b65858aa\" target=\"_blank\">The Guardian</a>&nbsp;պարբերականը:</p>\r\n\r\n<p>Ավիաընկերությունը հայտարարել է, որ մինչև 2022 թվականի ամառ չի ակնկալում ուղևորների կամ գների մինչկորոնավիրուսային մակարդակի վերականգնում:</p>\r\n\r\n<p>Ավիաընկերությունը հայտարարել է նաև, որ ծախսերի կտրուկ կրճատման շրջանակում մինչև ուղևորափոխադրումների վերսկսումը հնարավոր է փակվեն Եվրոպայում ընկերության մի շարք բազաներ:</p>\r\n\r\n<p>Ընկերությունը, որը պատրաստվում է հայտարարել 100 միլիոն եվրոյի վնասի մասին, տեղեկացրել է, որ աշխատատեղերի կրճատումը կսկսվի հուլիսից: Կրճատումները հիմնականում կվերաբերվեն օդաչուներին և բորտուղեկցորդներին:</p>\r\n', '<p>Եվրոպայի խոշորագույն ավիաընկերություններից մեկը՝ Ryanair ավիաընկերությունը, կորոնավիրուսի համավարակի պայմաններում թռիչքների կրճատման հետևանքով ծրագրում է 3000 աշխատատեղ կրճատել, աշխատակիցների աշխատավարձերն էլ իջեցնել մեկ հինգերորդով: Այս մասին տեղեկացնում է&nbsp;<a href=\"https://www.theguardian.com/world/live/2020/may/01/coronavirus-live-news-uk-is-past-the-peak-as-trump-claims-evidence-virus-started-in-wuhan-lab?fbclid=IwAR3Tngw9mE4BjKTeQKa8rn3suZuPOXnHrwKCwcBVjjY_Un_8_zKCRC3d0nQ#block-5eabc9108f08a459b65858aa\" target=\"_blank\">The Guardian</a>&nbsp;պարբերականը:</p>\r\n\r\n<p>Ավիաընկերությունը հայտարարել է, որ մինչև 2022 թվականի ամառ չի ակնկալում ուղևորների կամ գների մինչկորոնավիրուսային մակարդակի վերականգնում:</p>\r\n\r\n<p>Ավիաընկերությունը հայտարարել է նաև, որ ծախսերի կտրուկ կրճատման շրջանակում մինչև ուղևորափոխադրումների վերսկսումը հնարավոր է փակվեն Եվրոպայում ընկերության մի շարք բազաներ:</p>\r\n\r\n<p>Ընկերությունը, որը պատրաստվում է հայտարարել 100 միլիոն եվրոյի վնասի մասին, տեղեկացրել է, որ աշխատատեղերի կրճատումը կսկսվի հուլիսից: Կրճատումները հիմնականում կվերաբերվեն օդաչուներին և բորտուղեկցորդներին:</p>\r\n', '<p>Եվրոպայի խոշորագույն ավիաընկերություններից մեկը՝ Ryanair ավիաընկերությունը, կորոնավիրուսի համավարակի պայմաններում թռիչքների կրճատման հետևանքով ծրագրում է 3000 աշխատատեղ կրճատել, աշխատակիցների աշխատավարձերն էլ իջեցնել մեկ հինգերորդով: Այս մասին տեղեկացնում է&nbsp;<a href=\"https://www.theguardian.com/world/live/2020/may/01/coronavirus-live-news-uk-is-past-the-peak-as-trump-claims-evidence-virus-started-in-wuhan-lab?fbclid=IwAR3Tngw9mE4BjKTeQKa8rn3suZuPOXnHrwKCwcBVjjY_Un_8_zKCRC3d0nQ#block-5eabc9108f08a459b65858aa\" target=\"_blank\">The Guardian</a>&nbsp;պարբերականը:</p>\r\n\r\n<p>Ավիաընկերությունը հայտարարել է, որ մինչև 2022 թվականի ամառ չի ակնկալում ուղևորների կամ գների մինչկորոնավիրուսային մակարդակի վերականգնում:</p>\r\n\r\n<p>Ավիաընկերությունը հայտարարել է նաև, որ ծախսերի կտրուկ կրճատման շրջանակում մինչև ուղևորափոխադրումների վերսկսումը հնարավոր է փակվեն Եվրոպայում ընկերության մի շարք բազաներ:</p>\r\n\r\n<p>Ընկերությունը, որը պատրաստվում է հայտարարել 100 միլիոն եվրոյի վնասի մասին, տեղեկացրել է, որ աշխատատեղերի կրճատումը կսկսվի հուլիսից: Կրճատումները հիմնականում կվերաբերվեն օդաչուներին և բորտուղեկցորդներին:</p>\r\n', 'http://www.oferta.am/uploadBlog/RAnair_2.png', '2020-05-01 00:00:00');
INSERT INTO `userfularticlescontroller` VALUES (16, 'Գլոբալ դրամահավաք՝ COVID-19-ի դեմ պատվաստանյութի մշակման համար', 'Գլոբալ դրամահավաք՝ COVID-19-ի դեմ պատվաստանյութի մշակման համար', 'Գլոբալ դրամահավաք՝ COVID-19-ի դեմ պատվաստանյութի մշակման համար', '<p><strong>Եվրոպական հանձնաժողովը &euro;1մլրդ է տրամադրում COVID-19-ի դեմ պատվաստանյութի մշակման համար, նախօրեին հայտարարել է Եվրահանձնաժողովի նախագահ Ուրսուլա ֆոն դեր Լյայենը:</strong></p>\r\n\r\n<p>Deutsche Welle-ի&nbsp;<strong><a href=\"https://www.dw.com/ru/%D0%B5%D0%B2%D1%80%D0%BE%D0%BA%D0%BE%D0%BC%D0%B8%D1%81%D1%81%D0%B8%D1%8F-%D0%B2%D1%8B%D0%B4%D0%B5%D0%BB%D0%B8%D0%BB%D0%B0-1-%D0%BC%D0%BB%D1%80%D0%B4-%D0%B5%D0%B2%D1%80%D0%BE-%D0%BD%D0%B0-%D1%80%D0%B0%D0%B7%D1%80%D0%B0%D0%B1%D0%BE%D1%258\" target=\"_blank\">փոխանցմամբ</a></strong>՝ այս մասին նա ասել է Global Responce կարգախոսով անցկացվող առցանց դրամահավաք կոնֆերանսի բացմանը:<br />\r\n<br />\r\nԱկցիայի նախնական նպատակն է հավաքել &euro;7,5 մլրդ՝ COVID-19-ի դեմ պատվաստանյութ ստեղծելու համար։<br />\r\n<br />\r\nԻր հերթին Գերմանիայի կանցլեր Անգելա Մերկելը հայտարարել է, որ Գերմանիան այս խնդրի լուծմանը հատկացնում է &euro;525 մլն։ Ֆրանսիայի նախագահ Էմանուել Մակրոնը հայտնել է &euro;500 մլն տրամադրման մասին։ Իսպանիան՝ վարչապետ Պեդրո Սանչեսի խոսքով, պատրաստ է &euro;125 մլն տրամադրել ընդհանուր հիմնադրամին։<br />\r\n<br />\r\nԲացի ԵՄ անդամ երկրներից կոնֆերանսի կազմակերպիչ են հանդիսացել Մեծ Բրիտանիան, Նորվեգիան, Ճապոնիան, Սաուդյան Արաբիան եւ Կանադան։<br />\r\n<br />\r\nՄԱԿ-ի գլխավոր քարտուղար Անտոնիո Գուտերեշը հայտարարել է, որ COVID-19-ի բուժումը պետք է ընկալվի որպես համաշխարհային հանրային բարիք եւ հասանելի լինի բոլորի համար:&nbsp;</p>\r\n', '<p><strong>Եվրոպական հանձնաժողովը &euro;1մլրդ է տրամադրում COVID-19-ի դեմ պատվաստանյութի մշակման համար, նախօրեին հայտարարել է Եվրահանձնաժողովի նախագահ Ուրսուլա ֆոն դեր Լյայենը:</strong></p>\r\n\r\n<p>Deutsche Welle-ի&nbsp;<strong><a href=\"https://www.dw.com/ru/%D0%B5%D0%B2%D1%80%D0%BE%D0%BA%D0%BE%D0%BC%D0%B8%D1%81%D1%81%D0%B8%D1%8F-%D0%B2%D1%8B%D0%B4%D0%B5%D0%BB%D0%B8%D0%BB%D0%B0-1-%D0%BC%D0%BB%D1%80%D0%B4-%D0%B5%D0%B2%D1%80%D0%BE-%D0%BD%D0%B0-%D1%80%D0%B0%D0%B7%D1%80%D0%B0%D0%B1%D0%BE%D1%258\" target=\"_blank\">փոխանցմամբ</a></strong>՝ այս մասին նա ասել է Global Responce կարգախոսով անցկացվող առցանց դրամահավաք կոնֆերանսի բացմանը:<br />\r\n<br />\r\nԱկցիայի նախնական նպատակն է հավաքել &euro;7,5 մլրդ՝ COVID-19-ի դեմ պատվաստանյութ ստեղծելու համար։<br />\r\n<br />\r\nԻր հերթին Գերմանիայի կանցլեր Անգելա Մերկելը հայտարարել է, որ Գերմանիան այս խնդրի լուծմանը հատկացնում է &euro;525 մլն։ Ֆրանսիայի նախագահ Էմանուել Մակրոնը հայտնել է &euro;500 մլն տրամադրման մասին։ Իսպանիան՝ վարչապետ Պեդրո Սանչեսի խոսքով, պատրաստ է &euro;125 մլն տրամադրել ընդհանուր հիմնադրամին։<br />\r\n<br />\r\nԲացի ԵՄ անդամ երկրներից կոնֆերանսի կազմակերպիչ են հանդիսացել Մեծ Բրիտանիան, Նորվեգիան, Ճապոնիան, Սաուդյան Արաբիան եւ Կանադան։<br />\r\n<br />\r\nՄԱԿ-ի գլխավոր քարտուղար Անտոնիո Գուտերեշը հայտարարել է, որ COVID-19-ի բուժումը պետք է ընկալվի որպես համաշխարհային հանրային բարիք եւ հասանելի լինի բոլորի համար:&nbsp;</p>\r\n', '<p><strong>Եվրոպական հանձնաժողովը &euro;1մլրդ է տրամադրում COVID-19-ի դեմ պատվաստանյութի մշակման համար, նախօրեին հայտարարել է Եվրահանձնաժողովի նախագահ Ուրսուլա ֆոն դեր Լյայենը:</strong></p>\r\n\r\n<p>Deutsche Welle-ի&nbsp;<strong><a href=\"https://www.dw.com/ru/%D0%B5%D0%B2%D1%80%D0%BE%D0%BA%D0%BE%D0%BC%D0%B8%D1%81%D1%81%D0%B8%D1%8F-%D0%B2%D1%8B%D0%B4%D0%B5%D0%BB%D0%B8%D0%BB%D0%B0-1-%D0%BC%D0%BB%D1%80%D0%B4-%D0%B5%D0%B2%D1%80%D0%BE-%D0%BD%D0%B0-%D1%80%D0%B0%D0%B7%D1%80%D0%B0%D0%B1%D0%BE%D1%258\" target=\"_blank\">փոխանցմամբ</a></strong>՝ այս մասին նա ասել է Global Responce կարգախոսով անցկացվող առցանց դրամահավաք կոնֆերանսի բացմանը:<br />\r\n<br />\r\nԱկցիայի նախնական նպատակն է հավաքել &euro;7,5 մլրդ՝ COVID-19-ի դեմ պատվաստանյութ ստեղծելու համար։<br />\r\n<br />\r\nԻր հերթին Գերմանիայի կանցլեր Անգելա Մերկելը հայտարարել է, որ Գերմանիան այս խնդրի լուծմանը հատկացնում է &euro;525 մլն։ Ֆրանսիայի նախագահ Էմանուել Մակրոնը հայտնել է &euro;500 մլն տրամադրման մասին։ Իսպանիան՝ վարչապետ Պեդրո Սանչեսի խոսքով, պատրաստ է &euro;125 մլն տրամադրել ընդհանուր հիմնադրամին։<br />\r\n<br />\r\nԲացի ԵՄ անդամ երկրներից կոնֆերանսի կազմակերպիչ են հանդիսացել Մեծ Բրիտանիան, Նորվեգիան, Ճապոնիան, Սաուդյան Արաբիան եւ Կանադան։<br />\r\n<br />\r\nՄԱԿ-ի գլխավոր քարտուղար Անտոնիո Գուտերեշը հայտարարել է, որ COVID-19-ի բուժումը պետք է ընկալվի որպես համաշխարհային հանրային բարիք եւ հասանելի լինի բոլորի համար:&nbsp;</p>\r\n', 'http://www.oferta.am/uploadBlog/Global dramahavaq.png', '2020-05-05 00:00:00');
INSERT INTO `userfularticlescontroller` VALUES (17, 'Մաթեմատիկական մոդելները կբացահայտեն բանկային ռիսկերը կորոնավիրուսի ժամանակ', 'Մաթեմատիկական մոդելները կբացահայտեն բանկային ռիսկերը կորոնավիրուսի ժամանակ', 'Մաթեմատիկական մոդելները կբացահայտեն բանկային ռիսկերը կորոնավիրուսի ժամանակ', '<p><strong>Մոսկվայի եւ Տոմսկի պետական համալսարանների (ՄՊՀ, ՏՊՀ) գիտնականներն արտասահմանյան գործընկերների հետ համատեղ կստեղծեն մաթեմատիկական մոդելներ՝ բանկային հատվածում նոր ռիսկերի բացահայտման եւ գնահատման համար, այդ թվում այն ռիսկերի, որոնք ի հայտ են եկել կորոնավիրուսի համավարակի ընթացքում:</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\nԻնչպես&nbsp;<strong><a href=\"https://nauka.tass.ru/nauka/8392981\" target=\"_blank\">հաղորդում է</a></strong>&nbsp;ՏԱՍՍ-ը, &laquo;գիտնականների միջազգային խումբը՝ ՏՊՀ-ի դոցենտ Եվգենի Պչելինցեւի գլխավորությամբ, սկսում է ֆինանսական համակարգի քանդմանը տանող ռիսկերի քարտեզի ստեղծման նախագծի իրականացումը&raquo;:<br />\r\n<br />\r\nՄՊՀ-ի տնտեսագետներն ու ՏՊՀ-ի մաթեմատիկոսները համատեղ կբացահայտեն բանկային հատվածի ռիսկերը եւ կառաջարկեն դրանց գնահատման համար միջոցներ: Նախագիծը կիրականացվի Ռուսաստանի գիտական հիմնադրամի դրամաշնորհի միջոցներով:<br />\r\n<br />\r\nՆախագիծն ենթադրում է մաթեմատիկական մոդելների ստեղծում եւ վերլուծություն, ինչը հնարավորության կտա հաշվարկելու՝ դժվար տնտեսական պայմաններում որ դեպքերում կարող է տեղի ունենալ ֆինանսական շուկաների փլուզումը, այդ թվում՝ կորոնավիրուսի համավարակի պայմաններում:<br />\r\n<br />\r\nԱշխատանքի ընթացքում վերլուծաբանները կօգտագործեն ֆինանսական ցուցանիշների մասին տվյալները Bloomberg-ի, ինչպես նաեւ CRSP նեղ մասնագիտացած բազաներից: Ստացված մոդելները կօգտագործվեն հաշվարկների համար՝ շուկայի կոնկրետ խաղացողների խնդրանքով, կամ միջնորդ ընկերությունների հետ համագործակցությամբ:<br />\r\n<br />\r\nԴրանցով արդեն հետաքրքրված են Նորմանդիայի բիզնես կենտրոնները՝ Neoma Business School-ն ու Ecole de Management de Normandie-ն:</p>\r\n', '<p><strong>Մոսկվայի եւ Տոմսկի պետական համալսարանների (ՄՊՀ, ՏՊՀ) գիտնականներն արտասահմանյան գործընկերների հետ համատեղ կստեղծեն մաթեմատիկական մոդելներ՝ բանկային հատվածում նոր ռիսկերի բացահայտման եւ գնահատման համար, այդ թվում այն ռիսկերի, որոնք ի հայտ են եկել կորոնավիրուսի համավարակի ընթացքում:</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\nԻնչպես&nbsp;<strong><a href=\"https://nauka.tass.ru/nauka/8392981\" target=\"_blank\">հաղորդում է</a></strong>&nbsp;ՏԱՍՍ-ը, &laquo;գիտնականների միջազգային խումբը՝ ՏՊՀ-ի դոցենտ Եվգենի Պչելինցեւի գլխավորությամբ, սկսում է ֆինանսական համակարգի քանդմանը տանող ռիսկերի քարտեզի ստեղծման նախագծի իրականացումը&raquo;:<br />\r\n<br />\r\nՄՊՀ-ի տնտեսագետներն ու ՏՊՀ-ի մաթեմատիկոսները համատեղ կբացահայտեն բանկային հատվածի ռիսկերը եւ կառաջարկեն դրանց գնահատման համար միջոցներ: Նախագիծը կիրականացվի Ռուսաստանի գիտական հիմնադրամի դրամաշնորհի միջոցներով:<br />\r\n<br />\r\nՆախագիծն ենթադրում է մաթեմատիկական մոդելների ստեղծում եւ վերլուծություն, ինչը հնարավորության կտա հաշվարկելու՝ դժվար տնտեսական պայմաններում որ դեպքերում կարող է տեղի ունենալ ֆինանսական շուկաների փլուզումը, այդ թվում՝ կորոնավիրուսի համավարակի պայմաններում:<br />\r\n<br />\r\nԱշխատանքի ընթացքում վերլուծաբանները կօգտագործեն ֆինանսական ցուցանիշների մասին տվյալները Bloomberg-ի, ինչպես նաեւ CRSP նեղ մասնագիտացած բազաներից: Ստացված մոդելները կօգտագործվեն հաշվարկների համար՝ շուկայի կոնկրետ խաղացողների խնդրանքով, կամ միջնորդ ընկերությունների հետ համագործակցությամբ:<br />\r\n<br />\r\nԴրանցով արդեն հետաքրքրված են Նորմանդիայի բիզնես կենտրոնները՝ Neoma Business School-ն ու Ecole de Management de Normandie-ն:</p>\r\n', '<p><strong>Մոսկվայի եւ Տոմսկի պետական համալսարանների (ՄՊՀ, ՏՊՀ) գիտնականներն արտասահմանյան գործընկերների հետ համատեղ կստեղծեն մաթեմատիկական մոդելներ՝ բանկային հատվածում նոր ռիսկերի բացահայտման եւ գնահատման համար, այդ թվում այն ռիսկերի, որոնք ի հայտ են եկել կորոնավիրուսի համավարակի ընթացքում:</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\nԻնչպես&nbsp;<strong><a href=\"https://nauka.tass.ru/nauka/8392981\" target=\"_blank\">հաղորդում է</a></strong>&nbsp;ՏԱՍՍ-ը, &laquo;գիտնականների միջազգային խումբը՝ ՏՊՀ-ի դոցենտ Եվգենի Պչելինցեւի գլխավորությամբ, սկսում է ֆինանսական համակարգի քանդմանը տանող ռիսկերի քարտեզի ստեղծման նախագծի իրականացումը&raquo;:<br />\r\n<br />\r\nՄՊՀ-ի տնտեսագետներն ու ՏՊՀ-ի մաթեմատիկոսները համատեղ կբացահայտեն բանկային հատվածի ռիսկերը եւ կառաջարկեն դրանց գնահատման համար միջոցներ: Նախագիծը կիրականացվի Ռուսաստանի գիտական հիմնադրամի դրամաշնորհի միջոցներով:<br />\r\n<br />\r\nՆախագիծն ենթադրում է մաթեմատիկական մոդելների ստեղծում եւ վերլուծություն, ինչը հնարավորության կտա հաշվարկելու՝ դժվար տնտեսական պայմաններում որ դեպքերում կարող է տեղի ունենալ ֆինանսական շուկաների փլուզումը, այդ թվում՝ կորոնավիրուսի համավարակի պայմաններում:<br />\r\n<br />\r\nԱշխատանքի ընթացքում վերլուծաբանները կօգտագործեն ֆինանսական ցուցանիշների մասին տվյալները Bloomberg-ի, ինչպես նաեւ CRSP նեղ մասնագիտացած բազաներից: Ստացված մոդելները կօգտագործվեն հաշվարկների համար՝ շուկայի կոնկրետ խաղացողների խնդրանքով, կամ միջնորդ ընկերությունների հետ համագործակցությամբ:<br />\r\n<br />\r\nԴրանցով արդեն հետաքրքրված են Նորմանդիայի բիզնես կենտրոնները՝ Neoma Business School-ն ու Ecole de Management de Normandie-ն:</p>\r\n', 'http://www.oferta.am/uploadBlog/Matematikakan model.png', '2020-05-05 00:00:00');
INSERT INTO `userfularticlescontroller` VALUES (18, 'MasterCard. Համավարակը 40%-ով ավելացրել է անհպում վճարումների թիվը', 'MasterCard. Համավարակը 40%-ով ավելացրել է անհպում վճարումների թիվը', 'MasterCard. Համավարակը 40%-ով ավելացրել է անհպում վճարումների թիվը', '<p><strong>Կորոնավիրուսի համավարակի պայմաններում շարունակվում է աճել անհպում վճարումների թիվը։ MasterCard վճարային համակարգի կողմից 19 երկրների 17 հազ․ մարդկանց շրջանում անցկացրած հարցման արդյունքները վկայում են, որ 2019թ․ առաջին եռամսյակի համեմատ՝ այս տարի նման վճարումների թիվն աճել է 40%-ով:</strong></p>\r\n\r\n<p><br />\r\nԻնչպես&nbsp;<strong><a href=\"https://bloomchain.ru/newsfeed/mastercard-beskontaktnye-platezhi-ostanutsya-populyarnymi-i-posle-pandemii/\" target=\"_blank\">հաղորդում է</a></strong>&nbsp;Вloomchain.ru-ն, MasterCard-ի գլխավոր տնօրեն Աջայ Բանգան պարզաբանել է, որ անհպում վճարումների հանրամատչելիության աճը պայմանավորված է նրանով, որ գնորդները ձգտում են &laquo;խանութ մտնել եւ դուրս գալ այնտեղից՝ չփոխանակելով գումարը եւ չդիպչելով տերմինալներին կամ ուրեւէ այլ բանի&raquo;։ &laquo;Մենք տեսնում ենք անհպում վճարումների օգտագործման աճ եւ կարծում, որ այդ միտումը կշարունակվի նաեւ համավարակից հետո&raquo;,- ասել է Բանգան։<br />\r\n<br />\r\nMasterCard-ի կողմից հարցվածների 79%-ը հայտնել է, որ անհպում վճարումների հուսալիությունից եւ անվտանգությունից ելնելով՝ օգտվում են բացառապես վճարման այդ տեսակից։&nbsp; Միաժամանակ հարցվածների գրեթե կեսը (46%-ը) հայտնել է, որ միայն վերջերս է սկսել օգտագործել անհպում վճարումները։<br />\r\n<br />\r\nMasterCard-ի վերլուծաբաններն արձանագրել են նաեւ առանց քարտի ներկայացման (card not present) գործարքների թվի աճ․ դրանք բանկային քարտերով այնպիսի գործարքներ են, որոնց ընթացում քարտապանը պլաստիկի հետ միասին ներկա չի գտնվում վճարման վայրում։ Խոշոր քաղաքներում իշխանությունների կողմից ներդրված սահմանափակումների հետեւանքով նման տեսակի վճարումների թիվը տարվա կտրվածքով աճել է 40%-ով։<br />\r\n<br />\r\nՄիաժամանակ քարտի ներկայացմամբ (card present) գործարքների թիվը կտրուկ նվազել է։<br />\r\n<br />\r\nՎերլուծաբանների հետ տեսազանգի ժամանակ Աջայ Բանգան ասել է, որ շուկաների մեծ մասում սպառողական ծախսերի նվազման հետ կապված վիճակը &laquo;գտնվում է կայունացման փուլում&raquo;, ինչը հույս է ներշնչում, որ շուտով այդ ծախսերը կհասնեն &laquo;հատակին&raquo;, եւ շուկաները կսկսեն վերականգնվել։</p>\r\n', '<p><strong>Կորոնավիրուսի համավարակի պայմաններում շարունակվում է աճել անհպում վճարումների թիվը։ MasterCard վճարային համակարգի կողմից 19 երկրների 17 հազ․ մարդկանց շրջանում անցկացրած հարցման արդյունքները վկայում են, որ 2019թ․ առաջին եռամսյակի համեմատ՝ այս տարի նման վճարումների թիվն աճել է 40%-ով:</strong></p>\r\n\r\n<p><br />\r\nԻնչպես&nbsp;<strong><a href=\"https://bloomchain.ru/newsfeed/mastercard-beskontaktnye-platezhi-ostanutsya-populyarnymi-i-posle-pandemii/\" target=\"_blank\">հաղորդում է</a></strong>&nbsp;Вloomchain.ru-ն, MasterCard-ի գլխավոր տնօրեն Աջայ Բանգան պարզաբանել է, որ անհպում վճարումների հանրամատչելիության աճը պայմանավորված է նրանով, որ գնորդները ձգտում են &laquo;խանութ մտնել եւ դուրս գալ այնտեղից՝ չփոխանակելով գումարը եւ չդիպչելով տերմինալներին կամ ուրեւէ այլ բանի&raquo;։ &laquo;Մենք տեսնում ենք անհպում վճարումների օգտագործման աճ եւ կարծում, որ այդ միտումը կշարունակվի նաեւ համավարակից հետո&raquo;,- ասել է Բանգան։<br />\r\n<br />\r\nMasterCard-ի կողմից հարցվածների 79%-ը հայտնել է, որ անհպում վճարումների հուսալիությունից եւ անվտանգությունից ելնելով՝ օգտվում են բացառապես վճարման այդ տեսակից։&nbsp; Միաժամանակ հարցվածների գրեթե կեսը (46%-ը) հայտնել է, որ միայն վերջերս է սկսել օգտագործել անհպում վճարումները։<br />\r\n<br />\r\nMasterCard-ի վերլուծաբաններն արձանագրել են նաեւ առանց քարտի ներկայացման (card not present) գործարքների թվի աճ․ դրանք բանկային քարտերով այնպիսի գործարքներ են, որոնց ընթացում քարտապանը պլաստիկի հետ միասին ներկա չի գտնվում վճարման վայրում։ Խոշոր քաղաքներում իշխանությունների կողմից ներդրված սահմանափակումների հետեւանքով նման տեսակի վճարումների թիվը տարվա կտրվածքով աճել է 40%-ով։<br />\r\n<br />\r\nՄիաժամանակ քարտի ներկայացմամբ (card present) գործարքների թիվը կտրուկ նվազել է։<br />\r\n<br />\r\nՎերլուծաբանների հետ տեսազանգի ժամանակ Աջայ Բանգան ասել է, որ շուկաների մեծ մասում սպառողական ծախսերի նվազման հետ կապված վիճակը &laquo;գտնվում է կայունացման փուլում&raquo;, ինչը հույս է ներշնչում, որ շուտով այդ ծախսերը կհասնեն &laquo;հատակին&raquo;, եւ շուկաները կսկսեն վերականգնվել։</p>\r\n', '<p><strong>Կորոնավիրուսի համավարակի պայմաններում շարունակվում է աճել անհպում վճարումների թիվը։ MasterCard վճարային համակարգի կողմից 19 երկրների 17 հազ․ մարդկանց շրջանում անցկացրած հարցման արդյունքները վկայում են, որ 2019թ․ առաջին եռամսյակի համեմատ՝ այս տարի նման վճարումների թիվն աճել է 40%-ով:</strong></p>\r\n\r\n<p><br />\r\nԻնչպես&nbsp;<strong><a href=\"https://bloomchain.ru/newsfeed/mastercard-beskontaktnye-platezhi-ostanutsya-populyarnymi-i-posle-pandemii/\" target=\"_blank\">հաղորդում է</a></strong>&nbsp;Вloomchain.ru-ն, MasterCard-ի գլխավոր տնօրեն Աջայ Բանգան պարզաբանել է, որ անհպում վճարումների հանրամատչելիության աճը պայմանավորված է նրանով, որ գնորդները ձգտում են &laquo;խանութ մտնել եւ դուրս գալ այնտեղից՝ չփոխանակելով գումարը եւ չդիպչելով տերմինալներին կամ ուրեւէ այլ բանի&raquo;։ &laquo;Մենք տեսնում ենք անհպում վճարումների օգտագործման աճ եւ կարծում, որ այդ միտումը կշարունակվի նաեւ համավարակից հետո&raquo;,- ասել է Բանգան։<br />\r\n<br />\r\nMasterCard-ի կողմից հարցվածների 79%-ը հայտնել է, որ անհպում վճարումների հուսալիությունից եւ անվտանգությունից ելնելով՝ օգտվում են բացառապես վճարման այդ տեսակից։&nbsp; Միաժամանակ հարցվածների գրեթե կեսը (46%-ը) հայտնել է, որ միայն վերջերս է սկսել օգտագործել անհպում վճարումները։<br />\r\n<br />\r\nMasterCard-ի վերլուծաբաններն արձանագրել են նաեւ առանց քարտի ներկայացման (card not present) գործարքների թվի աճ․ դրանք բանկային քարտերով այնպիսի գործարքներ են, որոնց ընթացում քարտապանը պլաստիկի հետ միասին ներկա չի գտնվում վճարման վայրում։ Խոշոր քաղաքներում իշխանությունների կողմից ներդրված սահմանափակումների հետեւանքով նման տեսակի վճարումների թիվը տարվա կտրվածքով աճել է 40%-ով։<br />\r\n<br />\r\nՄիաժամանակ քարտի ներկայացմամբ (card present) գործարքների թիվը կտրուկ նվազել է։<br />\r\n<br />\r\nՎերլուծաբանների հետ տեսազանգի ժամանակ Աջայ Բանգան ասել է, որ շուկաների մեծ մասում սպառողական ծախսերի նվազման հետ կապված վիճակը &laquo;գտնվում է կայունացման փուլում&raquo;, ինչը հույս է ներշնչում, որ շուտով այդ ծախսերը կհասնեն &laquo;հատակին&raquo;, եւ շուկաները կսկսեն վերականգնվել։</p>\r\n', 'http://www.oferta.am/uploadBlog/MC.png', '2020-05-07 00:00:00');
INSERT INTO `userfularticlescontroller` VALUES (19, 'ՎՏԲ-Հայաստան Բանկը երկարաձգում է վարկային արձակուրդները մինչեւ մայիսի 31-ը', 'ՎՏԲ-Հայաստան Բանկը երկարաձգում է վարկային արձակուրդները մինչեւ մայիսի 31-ը', 'ՎՏԲ-Հայաստան Բանկը երկարաձգում է վարկային արձակուրդները մինչեւ մայիսի 31-ը', '<p><strong>ՎՏԲ-Հայաստան Բանկն իր հաճախորդների՝ ֆիզիկական, իրավաբանական անձանց եւ&nbsp; անհատ ձեռներեցների համար երկարաձգում է վարկային արձակուրդները մինչեւ 2020թ. մայիսի 31-ը: Բանկի վարկառուները կարող են ստանալ վարկի մարումների հետաձգում:</strong></p>\r\n\r\n<p>Բանկում նշել են, որ ներկա պահին ֆիզիկական անձ հանդիսացող հաճախորդների համար հասանելի են վարկային արձակուրդներ՝ ինչպես մայր գումարի, այնպես էլ տոկոսագումարի մարման հետաձգման գծով:<br />\r\n<br />\r\nԱնհատ ձեռներեցների եւ իրավաբանական անձանց համար հետաձգումը հասանելի է գործող անգրավ վարկերի մայր գումարի եւ տոկոսագումարի մարման համար՝ 7 մլն դրամը չգերազանցող գումարի չափով (պայմանագրային սկզբնական գումար): Պայմանները վերաբերում են ինչպես դրամային, այնպես էլ արտարժույթով վարկերին:&nbsp;&nbsp; &nbsp;<br />\r\n<br />\r\nԲանկի կողմից վարկային արձակուրդներ տրամադրելու գործընթացին կարելի է ծանոթանալ բանկի պաշտոնական կայքում․ ֆիզիկական անձ հանդիսացող հաճախորդների համար՝&nbsp;<strong><a href=\"https://www.vtb.am/am/about-bank/news-view/bank-vtb-armeniia-kak-sotsialno-orientirovannyi-bank-predlagaet\" target=\"_blank\">այս հղումով</a></strong>, իրավաբանական անձ կամ անհատ ձեռներեց հանդիսացող հաճախորդների համար՝&nbsp;<strong><a href=\"https://www.vtb.am/am/about-bank/news-view/obiavlenie-dlia-chastnykh-predprinimatelei-i-iuridicheskikh-lits\" target=\"_blank\">այս հղումով</a></strong>։<br />\r\n<br />\r\n&laquo;ՎՏԲ-Հայաստան Բանկը հորդորում է իր բոլոր&nbsp; վարկառուներին, ովքեր շարունակում են ստանալ եկամուտներ եւ հնարավորություն ունեն&nbsp; իրականացնելու իրենց վարկային մարումները, մինչեւ մայիսի 31-ն ընկած ժամանակահատվածում կատարել իրենց վճարումներն ըստ սկզբնական մարման ժամանակացույցի՝ հետագայում մարման ժամկետի երկարաձգումից խուսափելու նպատակով։<br />\r\n<br />\r\nՀիշեցնում ենք, որ ՎՏԲ-Հայաստան Բանկի ծառայություններից կարելի է օգտվել առանց մասնաճյուղ այցելելու՝ առցանց եղանակով՝ Մոբայլ/Ինտերնետ Բանկ, Վիդեո Բանկ ծառայությունների միջոցով&raquo;,- նշված է հաղորդագրության մեջ։<br />\r\n<br />\r\nԲանկը վերահսկվում է ՀՀ ԿԲ կողմից։</p>\r\n', '<p><strong>ՎՏԲ-Հայաստան Բանկն իր հաճախորդների՝ ֆիզիկական, իրավաբանական անձանց եւ&nbsp; անհատ ձեռներեցների համար երկարաձգում է վարկային արձակուրդները մինչեւ 2020թ. մայիսի 31-ը: Բանկի վարկառուները կարող են ստանալ վարկի մարումների հետաձգում:</strong></p>\r\n\r\n<p>Բանկում նշել են, որ ներկա պահին ֆիզիկական անձ հանդիսացող հաճախորդների համար հասանելի են վարկային արձակուրդներ՝ ինչպես մայր գումարի, այնպես էլ տոկոսագումարի մարման հետաձգման գծով:<br />\r\n<br />\r\nԱնհատ ձեռներեցների եւ իրավաբանական անձանց համար հետաձգումը հասանելի է գործող անգրավ վարկերի մայր գումարի եւ տոկոսագումարի մարման համար՝ 7 մլն դրամը չգերազանցող գումարի չափով (պայմանագրային սկզբնական գումար): Պայմանները վերաբերում են ինչպես դրամային, այնպես էլ արտարժույթով վարկերին:&nbsp;&nbsp; &nbsp;<br />\r\n<br />\r\nԲանկի կողմից վարկային արձակուրդներ տրամադրելու գործընթացին կարելի է ծանոթանալ բանկի պաշտոնական կայքում․ ֆիզիկական անձ հանդիսացող հաճախորդների համար՝&nbsp;<strong><a href=\"https://www.vtb.am/am/about-bank/news-view/bank-vtb-armeniia-kak-sotsialno-orientirovannyi-bank-predlagaet\" target=\"_blank\">այս հղումով</a></strong>, իրավաբանական անձ կամ անհատ ձեռներեց հանդիսացող հաճախորդների համար՝&nbsp;<strong><a href=\"https://www.vtb.am/am/about-bank/news-view/obiavlenie-dlia-chastnykh-predprinimatelei-i-iuridicheskikh-lits\" target=\"_blank\">այս հղումով</a></strong>։<br />\r\n<br />\r\n&laquo;ՎՏԲ-Հայաստան Բանկը հորդորում է իր բոլոր&nbsp; վարկառուներին, ովքեր շարունակում են ստանալ եկամուտներ եւ հնարավորություն ունեն&nbsp; իրականացնելու իրենց վարկային մարումները, մինչեւ մայիսի 31-ն ընկած ժամանակահատվածում կատարել իրենց վճարումներն ըստ սկզբնական մարման ժամանակացույցի՝ հետագայում մարման ժամկետի երկարաձգումից խուսափելու նպատակով։<br />\r\n<br />\r\nՀիշեցնում ենք, որ ՎՏԲ-Հայաստան Բանկի ծառայություններից կարելի է օգտվել առանց մասնաճյուղ այցելելու՝ առցանց եղանակով՝ Մոբայլ/Ինտերնետ Բանկ, Վիդեո Բանկ ծառայությունների միջոցով&raquo;,- նշված է հաղորդագրության մեջ։<br />\r\n<br />\r\nԲանկը վերահսկվում է ՀՀ ԿԲ կողմից։</p>\r\n', '<p><strong>ՎՏԲ-Հայաստան Բանկն իր հաճախորդների՝ ֆիզիկական, իրավաբանական անձանց եւ&nbsp; անհատ ձեռներեցների համար երկարաձգում է վարկային արձակուրդները մինչեւ 2020թ. մայիսի 31-ը: Բանկի վարկառուները կարող են ստանալ վարկի մարումների հետաձգում:</strong></p>\r\n\r\n<p>Բանկում նշել են, որ ներկա պահին ֆիզիկական անձ հանդիսացող հաճախորդների համար հասանելի են վարկային արձակուրդներ՝ ինչպես մայր գումարի, այնպես էլ տոկոսագումարի մարման հետաձգման գծով:<br />\r\n<br />\r\nԱնհատ ձեռներեցների եւ իրավաբանական անձանց համար հետաձգումը հասանելի է գործող անգրավ վարկերի մայր գումարի եւ տոկոսագումարի մարման համար՝ 7 մլն դրամը չգերազանցող գումարի չափով (պայմանագրային սկզբնական գումար): Պայմանները վերաբերում են ինչպես դրամային, այնպես էլ արտարժույթով վարկերին:&nbsp;&nbsp; &nbsp;<br />\r\n<br />\r\nԲանկի կողմից վարկային արձակուրդներ տրամադրելու գործընթացին կարելի է ծանոթանալ բանկի պաշտոնական կայքում․ ֆիզիկական անձ հանդիսացող հաճախորդների համար՝&nbsp;<strong><a href=\"https://www.vtb.am/am/about-bank/news-view/bank-vtb-armeniia-kak-sotsialno-orientirovannyi-bank-predlagaet\" target=\"_blank\">այս հղումով</a></strong>, իրավաբանական անձ կամ անհատ ձեռներեց հանդիսացող հաճախորդների համար՝&nbsp;<strong><a href=\"https://www.vtb.am/am/about-bank/news-view/obiavlenie-dlia-chastnykh-predprinimatelei-i-iuridicheskikh-lits\" target=\"_blank\">այս հղումով</a></strong>։<br />\r\n<br />\r\n&laquo;ՎՏԲ-Հայաստան Բանկը հորդորում է իր բոլոր&nbsp; վարկառուներին, ովքեր շարունակում են ստանալ եկամուտներ եւ հնարավորություն ունեն&nbsp; իրականացնելու իրենց վարկային մարումները, մինչեւ մայիսի 31-ն ընկած ժամանակահատվածում կատարել իրենց վճարումներն ըստ սկզբնական մարման ժամանակացույցի՝ հետագայում մարման ժամկետի երկարաձգումից խուսափելու նպատակով։<br />\r\n<br />\r\nՀիշեցնում ենք, որ ՎՏԲ-Հայաստան Բանկի ծառայություններից կարելի է օգտվել առանց մասնաճյուղ այցելելու՝ առցանց եղանակով՝ Մոբայլ/Ինտերնետ Բանկ, Վիդեո Բանկ ծառայությունների միջոցով&raquo;,- նշված է հաղորդագրության մեջ։<br />\r\n<br />\r\nԲանկը վերահսկվում է ՀՀ ԿԲ կողմից։</p>\r\n', 'http://www.oferta.am/uploadBlog/VTB ardzakurd.png', '2020-05-15 00:00:00');
INSERT INTO `userfularticlescontroller` VALUES (20, 'Что общего у Mastercard, высокой моды, женщин-художниц и блокчейна?', 'Что общего у Mastercard, высокой моды, женщин-художниц и блокчейна?', 'Что общего у Mastercard, высокой моды, женщин-художниц и блокчейна?', '<p>Что общего у Mastercard, высокой моды, женщин-художниц и блокчейна? Их объединяет созданное на основе технологии распределенных реестров решение Mastercard &mdash; Provenance.</p>\r\n\r\n<p>Система позволит сканировать QR-коды на ярлыках товаров премиум-сегмента и определять подлинность luxury-товаров, опираясь на данные, которые будут храниться на блокчейне. Также Provenance сделает возможным отследить весь &laquo;путь&raquo; вещи, который та проделала прежде, чем оказаться в руках у покупателя.</p>\r\n\r\n<p>По данным исследований, объем рынка контрафактной продукции в мире &mdash; примерно $323 млрд.&nbsp;</p>\r\n\r\n<p>Читать подробнее: https://www.finextra.com/newsarticle/34220/mastercard-takes-on-counterfeiters-with-blockchain-tech</p>\r\n', '<p>Что общего у Mastercard, высокой моды, женщин-художниц и блокчейна? Их объединяет созданное на основе технологии распределенных реестров решение Mastercard &mdash; Provenance.</p>\r\n\r\n<p>Система позволит сканировать QR-коды на ярлыках товаров премиум-сегмента и определять подлинность luxury-товаров, опираясь на данные, которые будут храниться на блокчейне. Также Provenance сделает возможным отследить весь &laquo;путь&raquo; вещи, который та проделала прежде, чем оказаться в руках у покупателя.</p>\r\n\r\n<p>По данным исследований, объем рынка контрафактной продукции в мире &mdash; примерно $323 млрд.&nbsp;</p>\r\n\r\n<p>Читать подробнее: https://www.finextra.com/newsarticle/34220/mastercard-takes-on-counterfeiters-with-blockchain-tech</p>\r\n', '<p>Что общего у Mastercard, высокой моды, женщин-художниц и блокчейна? Их объединяет созданное на основе технологии распределенных реестров решение Mastercard &mdash; Provenance.</p>\r\n\r\n<p>Система позволит сканировать QR-коды на ярлыках товаров премиум-сегмента и определять подлинность luxury-товаров, опираясь на данные, которые будут храниться на блокчейне. Также Provenance сделает возможным отследить весь &laquo;путь&raquo; вещи, который та проделала прежде, чем оказаться в руках у покупателя.</p>\r\n\r\n<p>По данным исследований, объем рынка контрафактной продукции в мире &mdash; примерно $323 млрд.&nbsp;</p>\r\n\r\n<p>Читать подробнее: https://www.finextra.com/newsarticle/34220/mastercard-takes-on-counterfeiters-with-blockchain-tech</p>\r\n', 'http://www.oferta.am/uploadBlog/Blockchain.png', '2020-05-21 00:00:00');
INSERT INTO `userfularticlescontroller` VALUES (21, 'Հաշվեկշռային հիմնական ցուցանիշների աճ ՀՀ բանկային համակարգում', 'Հաշվեկշռային հիմնական ցուցանիշների աճ ՀՀ բանկային համակարգում', 'Հաշվեկշռային հիմնական ցուցանիշների աճ ՀՀ բանկային համակարգում', '<p><em>Հայաստանյան բանկերը 2020թ. առաջին եռամսյակում արձանագրել են աճ հիմնական հաշվեկշռային ցուցանիշների ուղղությամբ 2019թ. նույն ժամանակահատվածի համեմատ: Համակարգի ընդհանուր ակտիվներն ավելացել են 15.3 %-ով, պարտավորությունները՝ 16.2 %-ով, կապիտալը՝ 9.9%-ով:</em></p>\r\n\r\n<p><br />\r\n<em>Ուսումնասիրելով ՀՀ առեւտրային բանկերի հրապարակած միջանկյալ ֆինանսական հաշվետվությունները՝&nbsp;<strong>Banks.am</strong>-ը ներկայացնում է 2020թ. առաջին եռամսյակում բանկային հատվածի հիմնական ֆինանսական ցուցանիշների վերլուծությունը:</em></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Ակտիվներ</strong><br />\r\n<br />\r\nՀՀ բանկային համակարգի ակտիվների ընդհանուր ծավալը 2020թ. առաջին եռամսյակում&nbsp; 2019թ. համադրելի ժամանակահատվածի համեմատ աճել է 15.3%-ով՝ կազմելով 5 907.16 մլրդ դրամ:<br />\r\n<br />\r\nԱկտիվների մեծությամբ առաջատարը&nbsp;<strong>Ամերիաբանկն</strong>&nbsp;է, որը 2019թ. նույն ժամանակահատվածի համեմատ արձանագրել է ցուցանիշի 17.4% աճ՝ 910.68 մլրդ դրամով:<br />\r\n&nbsp;&nbsp; &nbsp;<br />\r\nԱմերիաբանկին ակտիվների մեծությամբ հաջորդում է&nbsp;<strong>Արդշինբանկը</strong>&nbsp;արձանագրելով&nbsp; շուրջ 26.8% աճ եւ&nbsp; հասնելով 846.12 մլրդ դրամի: Առաջատար հնգյակում են նաեւ`&nbsp;<strong>Հայբիզնեսբանկը</strong>&nbsp;798.39 մլրդ դրամ (2019թ. համեմատ՝ 12.9% աճ),&nbsp;<strong>Ակբա-Կրեդիտ Ագրիկոլ Բանկը</strong>&nbsp;441.16 մլրդ դրամ (10.7% աճ) եւ&nbsp;<strong>Ինեկոբանկը</strong>&nbsp;341.62 մլրդ դրամ (11.6 % աճ) ցուցանիշներով :<br />\r\n<br />\r\n<strong>Պարտավորություններ</strong><br />\r\n<br />\r\nԲանկային համակարգի պարտավորությունների ընդհանուր ծավալը 2020թ. առաջին եռամսյակում 2019թ. համադրելի ժամանակահատվածի նկատմամբ ավելացել է 16.2%-ով՝կազմելով 5 045.08 մլրդ դրամ:<br />\r\n<br />\r\nՊարտավորությունների մեծությամբ առաջատարն&nbsp;<strong>Ամերիաբանկն</strong>&nbsp;է: Բանկի պարտավորությունները 2020թ. առաջին եռամսյակում աճել են&nbsp; 18.1 %-ով՝ կազմելով 806.47 մլրդ դրամ:<br />\r\n<br />\r\nԵրկրորդն ըստ պարտավորությունների&nbsp;<strong>Արդշինբանկն</strong>&nbsp;է 765.92 մլրդ դրամ ցուցանիշով արձանագրելով 28.1% աճ: Վերջիններիս հաջորդում են&nbsp;<strong>Հայբիզնեսբանկը</strong>&nbsp;745.52 մլրդ դրամ (աճը ՝ 12.2%),&nbsp;<strong>Ակբա-Կրեդիտ Ագրիկոլ Բանկը</strong>՝ 372.26 մլրդ դրամ (11.8% աճ), եւ&nbsp;<strong>Ինեկոբանկը</strong>՝ 283.11 մլրդ դրամ (աճը՝11.9%):<br />\r\n<br />\r\n<strong>Կապիտալ</strong><br />\r\n<br />\r\nՀաշվետու ժամանակահատվածում ՀՀ բանկային համակարգում կապիտալի աճը կազմել է 9.9 %, ինչի արդյունքում արձանագրվել է&nbsp; 862.08 մլրդ դրամ ցուցանիշը:<br />\r\n<br />\r\nԿապիտալի մեծությամբ առաջատարը կրկին&nbsp;<strong>Ամերիաբանկն</strong>&nbsp;է 104.21 մլրդ դրամ ցուցանիշով: Նախորդ տարվա նույն ժամանակահատվածի համեմատ աճը կազմել է 12,0 % :<br />\r\n<br />\r\nԵրկրորդը&nbsp;<strong>Արդշինբանկն</strong>&nbsp;է 80.2 մլրդ դրամ ցուցանիշով, որի կապիտալի աճը կազմել է 15.2%:<br />\r\n<br />\r\nԿապիտալի մեծությամբ մյուս առաջատարներն են&nbsp;<strong>Ակբա-Կրեդիտ Ագրիկոլ Բանկը</strong>&nbsp;68,9 մլրդ դրամ (աճը՝ 5.0%),&nbsp;<strong>Արմսվիսբանկը</strong>&nbsp;՝ 59,72 մլրդ դրամ ցուցանիշով (աճը՝ 30.2%), եւ առաջատար հնգյակը եզրափակում է&nbsp;<strong>Ինեկոբանկը</strong>, որն արձանագրել է 58.52 մլրդ&nbsp; դրամի ցուցանիշ կապիտալի 10.4% աճով:<br />\r\n<br />\r\nՆշենք, որ 2020թ. առաջին եռամսյակում առաջատար հինգ բանկերին բաժին է ընկել համակարգի ակտիվների 56.5%-ը, պարտավորությունների 58,9%-ը, եւ կապիտալի 43,1%-ը:<br />\r\n<br />\r\n<em>Ստորեւ բերված աղյուսակում ներկայացված են ՀՀ առեւտրային բանկերի հիմնական ֆինանսական ցուցանիշները՝ 2020թ. առաջին եռամսյակի դրությամբ: Ցուցանիշների աճ/անկումը հաշվարկված է 2019թ. նույն ժամանակահատվածի նկատմամբ:</em><br />\r\n<br />\r\n<em>Բանկերը դասավորված են ըստ ակտիվների մեծության՝ ամենամեծից ամենափոքրը:</em><br />\r\n<br />\r\n<img alt=\"\" src=\"https://banks.am/static/uploads/0T-1.jpg\" style=\"height:455px; width:700px\" /></p>\r\n\r\n<p><a href=\"https://banks.am/am/news/interviews/19336\">https://banks.am/am/news/interviews/19336</a></p>\r\n', '<p><em>Հայաստանյան բանկերը 2020թ. առաջին եռամսյակում արձանագրել են աճ հիմնական հաշվեկշռային ցուցանիշների ուղղությամբ 2019թ. նույն ժամանակահատվածի համեմատ: Համակարգի ընդհանուր ակտիվներն ավելացել են 15.3 %-ով, պարտավորությունները՝ 16.2 %-ով, կապիտալը՝ 9.9%-ով:</em></p>\r\n\r\n<p><br />\r\n<em>Ուսումնասիրելով ՀՀ առեւտրային բանկերի հրապարակած միջանկյալ ֆինանսական հաշվետվությունները՝&nbsp;<strong>Banks.am</strong>-ը ներկայացնում է 2020թ. առաջին եռամսյակում բանկային հատվածի հիմնական ֆինանսական ցուցանիշների վերլուծությունը:</em></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Ակտիվներ</strong><br />\r\n<br />\r\nՀՀ բանկային համակարգի ակտիվների ընդհանուր ծավալը 2020թ. առաջին եռամսյակում&nbsp; 2019թ. համադրելի ժամանակահատվածի համեմատ աճել է 15.3%-ով՝ կազմելով 5 907.16 մլրդ դրամ:<br />\r\n<br />\r\nԱկտիվների մեծությամբ առաջատարը&nbsp;<strong>Ամերիաբանկն</strong>&nbsp;է, որը 2019թ. նույն ժամանակահատվածի համեմատ արձանագրել է ցուցանիշի 17.4% աճ՝ 910.68 մլրդ դրամով:<br />\r\n&nbsp;&nbsp; &nbsp;<br />\r\nԱմերիաբանկին ակտիվների մեծությամբ հաջորդում է&nbsp;<strong>Արդշինբանկը</strong>&nbsp;արձանագրելով&nbsp; շուրջ 26.8% աճ եւ&nbsp; հասնելով 846.12 մլրդ դրամի: Առաջատար հնգյակում են նաեւ`&nbsp;<strong>Հայբիզնեսբանկը</strong>&nbsp;798.39 մլրդ դրամ (2019թ. համեմատ՝ 12.9% աճ),&nbsp;<strong>Ակբա-Կրեդիտ Ագրիկոլ Բանկը</strong>&nbsp;441.16 մլրդ դրամ (10.7% աճ) եւ&nbsp;<strong>Ինեկոբանկը</strong>&nbsp;341.62 մլրդ դրամ (11.6 % աճ) ցուցանիշներով :<br />\r\n<br />\r\n<strong>Պարտավորություններ</strong><br />\r\n<br />\r\nԲանկային համակարգի պարտավորությունների ընդհանուր ծավալը 2020թ. առաջին եռամսյակում 2019թ. համադրելի ժամանակահատվածի նկատմամբ ավելացել է 16.2%-ով՝կազմելով 5 045.08 մլրդ դրամ:<br />\r\n<br />\r\nՊարտավորությունների մեծությամբ առաջատարն&nbsp;<strong>Ամերիաբանկն</strong>&nbsp;է: Բանկի պարտավորությունները 2020թ. առաջին եռամսյակում աճել են&nbsp; 18.1 %-ով՝ կազմելով 806.47 մլրդ դրամ:<br />\r\n<br />\r\nԵրկրորդն ըստ պարտավորությունների&nbsp;<strong>Արդշինբանկն</strong>&nbsp;է 765.92 մլրդ դրամ ցուցանիշով արձանագրելով 28.1% աճ: Վերջիններիս հաջորդում են&nbsp;<strong>Հայբիզնեսբանկը</strong>&nbsp;745.52 մլրդ դրամ (աճը ՝ 12.2%),&nbsp;<strong>Ակբա-Կրեդիտ Ագրիկոլ Բանկը</strong>՝ 372.26 մլրդ դրամ (11.8% աճ), եւ&nbsp;<strong>Ինեկոբանկը</strong>՝ 283.11 մլրդ դրամ (աճը՝11.9%):<br />\r\n<br />\r\n<strong>Կապիտալ</strong><br />\r\n<br />\r\nՀաշվետու ժամանակահատվածում ՀՀ բանկային համակարգում կապիտալի աճը կազմել է 9.9 %, ինչի արդյունքում արձանագրվել է&nbsp; 862.08 մլրդ դրամ ցուցանիշը:<br />\r\n<br />\r\nԿապիտալի մեծությամբ առաջատարը կրկին&nbsp;<strong>Ամերիաբանկն</strong>&nbsp;է 104.21 մլրդ դրամ ցուցանիշով: Նախորդ տարվա նույն ժամանակահատվածի համեմատ աճը կազմել է 12,0 % :<br />\r\n<br />\r\nԵրկրորդը&nbsp;<strong>Արդշինբանկն</strong>&nbsp;է 80.2 մլրդ դրամ ցուցանիշով, որի կապիտալի աճը կազմել է 15.2%:<br />\r\n<br />\r\nԿապիտալի մեծությամբ մյուս առաջատարներն են&nbsp;<strong>Ակբա-Կրեդիտ Ագրիկոլ Բանկը</strong>&nbsp;68,9 մլրդ դրամ (աճը՝ 5.0%),&nbsp;<strong>Արմսվիսբանկը</strong>&nbsp;՝ 59,72 մլրդ դրամ ցուցանիշով (աճը՝ 30.2%), եւ առաջատար հնգյակը եզրափակում է&nbsp;<strong>Ինեկոբանկը</strong>, որն արձանագրել է 58.52 մլրդ&nbsp; դրամի ցուցանիշ կապիտալի 10.4% աճով:<br />\r\n<br />\r\nՆշենք, որ 2020թ. առաջին եռամսյակում առաջատար հինգ բանկերին բաժին է ընկել համակարգի ակտիվների 56.5%-ը, պարտավորությունների 58,9%-ը, եւ կապիտալի 43,1%-ը:<br />\r\n<br />\r\n<em>Ստորեւ բերված աղյուսակում ներկայացված են ՀՀ առեւտրային բանկերի հիմնական ֆինանսական ցուցանիշները՝ 2020թ. առաջին եռամսյակի դրությամբ: Ցուցանիշների աճ/անկումը հաշվարկված է 2019թ. նույն ժամանակահատվածի նկատմամբ:</em><br />\r\n<br />\r\n<em>Բանկերը դասավորված են ըստ ակտիվների մեծության՝ ամենամեծից ամենափոքրը:</em><br />\r\n<br />\r\n<img alt=\"\" src=\"https://banks.am/static/uploads/0T-1.jpg\" style=\"height:455px; width:700px\" /></p>\r\n\r\n<p><a href=\"https://banks.am/am/news/interviews/19336\">https://banks.am/am/news/interviews/19336</a></p>\r\n', '<p><em>Հայաստանյան բանկերը 2020թ. առաջին եռամսյակում արձանագրել են աճ հիմնական հաշվեկշռային ցուցանիշների ուղղությամբ 2019թ. նույն ժամանակահատվածի համեմատ: Համակարգի ընդհանուր ակտիվներն ավելացել են 15.3 %-ով, պարտավորությունները՝ 16.2 %-ով, կապիտալը՝ 9.9%-ով:</em></p>\r\n\r\n<p><br />\r\n<em>Ուսումնասիրելով ՀՀ առեւտրային բանկերի հրապարակած միջանկյալ ֆինանսական հաշվետվությունները՝&nbsp;<strong>Banks.am</strong>-ը ներկայացնում է 2020թ. առաջին եռամսյակում բանկային հատվածի հիմնական ֆինանսական ցուցանիշների վերլուծությունը:</em></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Ակտիվներ</strong><br />\r\n<br />\r\nՀՀ բանկային համակարգի ակտիվների ընդհանուր ծավալը 2020թ. առաջին եռամսյակում&nbsp; 2019թ. համադրելի ժամանակահատվածի համեմատ աճել է 15.3%-ով՝ կազմելով 5 907.16 մլրդ դրամ:<br />\r\n<br />\r\nԱկտիվների մեծությամբ առաջատարը&nbsp;<strong>Ամերիաբանկն</strong>&nbsp;է, որը 2019թ. նույն ժամանակահատվածի համեմատ արձանագրել է ցուցանիշի 17.4% աճ՝ 910.68 մլրդ դրամով:<br />\r\n&nbsp;&nbsp; &nbsp;<br />\r\nԱմերիաբանկին ակտիվների մեծությամբ հաջորդում է&nbsp;<strong>Արդշինբանկը</strong>&nbsp;արձանագրելով&nbsp; շուրջ 26.8% աճ եւ&nbsp; հասնելով 846.12 մլրդ դրամի: Առաջատար հնգյակում են նաեւ`&nbsp;<strong>Հայբիզնեսբանկը</strong>&nbsp;798.39 մլրդ դրամ (2019թ. համեմատ՝ 12.9% աճ),&nbsp;<strong>Ակբա-Կրեդիտ Ագրիկոլ Բանկը</strong>&nbsp;441.16 մլրդ դրամ (10.7% աճ) եւ&nbsp;<strong>Ինեկոբանկը</strong>&nbsp;341.62 մլրդ դրամ (11.6 % աճ) ցուցանիշներով :<br />\r\n<br />\r\n<strong>Պարտավորություններ</strong><br />\r\n<br />\r\nԲանկային համակարգի պարտավորությունների ընդհանուր ծավալը 2020թ. առաջին եռամսյակում 2019թ. համադրելի ժամանակահատվածի նկատմամբ ավելացել է 16.2%-ով՝կազմելով 5 045.08 մլրդ դրամ:<br />\r\n<br />\r\nՊարտավորությունների մեծությամբ առաջատարն&nbsp;<strong>Ամերիաբանկն</strong>&nbsp;է: Բանկի պարտավորությունները 2020թ. առաջին եռամսյակում աճել են&nbsp; 18.1 %-ով՝ կազմելով 806.47 մլրդ դրամ:<br />\r\n<br />\r\nԵրկրորդն ըստ պարտավորությունների&nbsp;<strong>Արդշինբանկն</strong>&nbsp;է 765.92 մլրդ դրամ ցուցանիշով արձանագրելով 28.1% աճ: Վերջիններիս հաջորդում են&nbsp;<strong>Հայբիզնեսբանկը</strong>&nbsp;745.52 մլրդ դրամ (աճը ՝ 12.2%),&nbsp;<strong>Ակբա-Կրեդիտ Ագրիկոլ Բանկը</strong>՝ 372.26 մլրդ դրամ (11.8% աճ), եւ&nbsp;<strong>Ինեկոբանկը</strong>՝ 283.11 մլրդ դրամ (աճը՝11.9%):<br />\r\n<br />\r\n<strong>Կապիտալ</strong><br />\r\n<br />\r\nՀաշվետու ժամանակահատվածում ՀՀ բանկային համակարգում կապիտալի աճը կազմել է 9.9 %, ինչի արդյունքում արձանագրվել է&nbsp; 862.08 մլրդ դրամ ցուցանիշը:<br />\r\n<br />\r\nԿապիտալի մեծությամբ առաջատարը կրկին&nbsp;<strong>Ամերիաբանկն</strong>&nbsp;է 104.21 մլրդ դրամ ցուցանիշով: Նախորդ տարվա նույն ժամանակահատվածի համեմատ աճը կազմել է 12,0 % :<br />\r\n<br />\r\nԵրկրորդը&nbsp;<strong>Արդշինբանկն</strong>&nbsp;է 80.2 մլրդ դրամ ցուցանիշով, որի կապիտալի աճը կազմել է 15.2%:<br />\r\n<br />\r\nԿապիտալի մեծությամբ մյուս առաջատարներն են&nbsp;<strong>Ակբա-Կրեդիտ Ագրիկոլ Բանկը</strong>&nbsp;68,9 մլրդ դրամ (աճը՝ 5.0%),&nbsp;<strong>Արմսվիսբանկը</strong>&nbsp;՝ 59,72 մլրդ դրամ ցուցանիշով (աճը՝ 30.2%), եւ առաջատար հնգյակը եզրափակում է&nbsp;<strong>Ինեկոբանկը</strong>, որն արձանագրել է 58.52 մլրդ&nbsp; դրամի ցուցանիշ կապիտալի 10.4% աճով:<br />\r\n<br />\r\nՆշենք, որ 2020թ. առաջին եռամսյակում առաջատար հինգ բանկերին բաժին է ընկել համակարգի ակտիվների 56.5%-ը, պարտավորությունների 58,9%-ը, եւ կապիտալի 43,1%-ը:<br />\r\n<br />\r\n<em>Ստորեւ բերված աղյուսակում ներկայացված են ՀՀ առեւտրային բանկերի հիմնական ֆինանսական ցուցանիշները՝ 2020թ. առաջին եռամսյակի դրությամբ: Ցուցանիշների աճ/անկումը հաշվարկված է 2019թ. նույն ժամանակահատվածի նկատմամբ:</em><br />\r\n<br />\r\n<em>Բանկերը դասավորված են ըստ ակտիվների մեծության՝ ամենամեծից ամենափոքրը:</em><br />\r\n<br />\r\n<img alt=\"\" src=\"https://banks.am/static/uploads/0T-1.jpg\" style=\"height:455px; width:700px\" /></p>\r\n\r\n<p><a href=\"https://banks.am/am/news/interviews/19336\">https://banks.am/am/news/interviews/19336</a></p>\r\n', 'http://www.oferta.am/uploadBlog/Bank.png', '2020-05-21 00:00:00');
INSERT INTO `userfularticlescontroller` VALUES (22, 'Փաշինյանը կարեւորել է բանկերի դերը Արցախի տնտեսական նվաճումներում', 'Փաշինյանը կարեւորել է բանկերի դերը Արցախի տնտեսական նվաճումներում', 'Փաշինյանը կարեւորել է բանկերի դերը Արցախի տնտեսական նվաճումներում', '<p><strong>Վերջին 10 տարվա ընթացքում Արցախում բանկային համակարգի բավականին լուրջ զարգացում է արձանագրվել, որն էական նշանակություն է ունեցել Արցախի տնտեսական հաջողությունների համար:</strong></p>\r\n\r\n<p><br />\r\nԱյս մասին ասել Հայաստանի վարչապետ Նիկոլ Փաշինյանը, ով&nbsp; Արցախի Հանրապետության (ԱՀ) նորընտիր նախագահ Արայիկ Հարությունյանի հետ Ստեփանակերտում հանդիպում է ունեցել ՀՀ եւ ԱՀ բանկային համակարգերի ներկայացուցիչների հետ` Կենտրոնական բանկերի ղեկավարների գլխավորությամբ:<br />\r\n<br />\r\n&laquo;Տնտեսական այն հավակնությունները, որ ունենք համատեղ, հնարավոր չի լինի իրագործել, եթե այդ բովանդակությունն ընկալված չլինի բանկային համակարգի կողմից: Ինչ որ առումով այդ բովանդակությունը պետք է համատեղ ձևավորվի:&nbsp; Հակաճգնաժամային այս ժամանակաշրջանում նաև դրա փորձը կիրառում ենք, երբ կառավարության, բանկային համակարգի ու խորհրդարանի ներկայացուցիչները մի սեղանի շուրջ նստած քննարկում են գյուղատնտեսության զարգացման, ճգնաժամը հաղթահարելու, սոցիալական խնդիրները լուծելու հարցեր: Սա իսկապես արդյունավետ կարող է լինել և սա պետք է դիտարկել ոչ թե առանձին վերցրած հանդիպում, այլ խոսակցություն, որն անընդհատ պետք է շարունակվի&raquo;,- նշել է Նիկոլ Փաշինյանը:<br />\r\n<br />\r\nԱրայիկ Հարությունյանն էլ ասել է, որ ցանկալի է ոչ թե շարունակել, այլ ավելի ակտիվացնել համագործակցությունը, &laquo;քանի որ առաջիկայում նախատեսում ենք զարգացման շատ ավելի մեծ տեմպեր ապահովել, իսկ միայն երկու կառավարությունների ֆինանսական միջոցները թույլ չեն տա դա անել&raquo;:<br />\r\n<br />\r\n&laquo;Պետք է լինելու ավելի հավակնոտ ծրագրեր իրականացնել&raquo;,- ասել է Արցախի նախագահը:<br />\r\n<br />\r\nՀանդիպման ընթացքում քննարկվել են ֆինանսական, բանկային համակարգերի համագործակցության ընդլայնմանը, Արցախում հայաստանյան բանկերի գործունեության խթանմանը, բիզնես ծրագրերի ֆինանսանավորման ակտիվացմանը, տնտեսության տարբեր ճյուղերում, այդ թվում` գյուղատնտեսության, ներդրումային նախագծերի ֆինանսավորմանը վերաբերող հարցեր:<br />\r\n<br />\r\nԲանկային համակարգի ներկայացուցիչները պատրաստակամություն են հայտնել ականջալուր լինել Հայաստանի և Արցախի կառավարությունների նախաձեռնություններին և առավել ընդլայնված կերպով ներգրավվել ծրագրերի իրականացմանը` շուկայի համար ապահովելով ավելի մեծ ու ցածր տոկոսադրույքներով միջոցներ:&nbsp;</p>\r\n', '<p><strong>Վերջին 10 տարվա ընթացքում Արցախում բանկային համակարգի բավականին լուրջ զարգացում է արձանագրվել, որն էական նշանակություն է ունեցել Արցախի տնտեսական հաջողությունների համար:</strong></p>\r\n\r\n<p><br />\r\nԱյս մասին ասել Հայաստանի վարչապետ Նիկոլ Փաշինյանը, ով&nbsp; Արցախի Հանրապետության (ԱՀ) նորընտիր նախագահ Արայիկ Հարությունյանի հետ Ստեփանակերտում հանդիպում է ունեցել ՀՀ եւ ԱՀ բանկային համակարգերի ներկայացուցիչների հետ` Կենտրոնական բանկերի ղեկավարների գլխավորությամբ:<br />\r\n<br />\r\n&laquo;Տնտեսական այն հավակնությունները, որ ունենք համատեղ, հնարավոր չի լինի իրագործել, եթե այդ բովանդակությունն ընկալված չլինի բանկային համակարգի կողմից: Ինչ որ առումով այդ բովանդակությունը պետք է համատեղ ձևավորվի:&nbsp; Հակաճգնաժամային այս ժամանակաշրջանում նաև դրա փորձը կիրառում ենք, երբ կառավարության, բանկային համակարգի ու խորհրդարանի ներկայացուցիչները մի սեղանի շուրջ նստած քննարկում են գյուղատնտեսության զարգացման, ճգնաժամը հաղթահարելու, սոցիալական խնդիրները լուծելու հարցեր: Սա իսկապես արդյունավետ կարող է լինել և սա պետք է դիտարկել ոչ թե առանձին վերցրած հանդիպում, այլ խոսակցություն, որն անընդհատ պետք է շարունակվի&raquo;,- նշել է Նիկոլ Փաշինյանը:<br />\r\n<br />\r\nԱրայիկ Հարությունյանն էլ ասել է, որ ցանկալի է ոչ թե շարունակել, այլ ավելի ակտիվացնել համագործակցությունը, &laquo;քանի որ առաջիկայում նախատեսում ենք զարգացման շատ ավելի մեծ տեմպեր ապահովել, իսկ միայն երկու կառավարությունների ֆինանսական միջոցները թույլ չեն տա դա անել&raquo;:<br />\r\n<br />\r\n&laquo;Պետք է լինելու ավելի հավակնոտ ծրագրեր իրականացնել&raquo;,- ասել է Արցախի նախագահը:<br />\r\n<br />\r\nՀանդիպման ընթացքում քննարկվել են ֆինանսական, բանկային համակարգերի համագործակցության ընդլայնմանը, Արցախում հայաստանյան բանկերի գործունեության խթանմանը, բիզնես ծրագրերի ֆինանսանավորման ակտիվացմանը, տնտեսության տարբեր ճյուղերում, այդ թվում` գյուղատնտեսության, ներդրումային նախագծերի ֆինանսավորմանը վերաբերող հարցեր:<br />\r\n<br />\r\nԲանկային համակարգի ներկայացուցիչները պատրաստակամություն են հայտնել ականջալուր լինել Հայաստանի և Արցախի կառավարությունների նախաձեռնություններին և առավել ընդլայնված կերպով ներգրավվել ծրագրերի իրականացմանը` շուկայի համար ապահովելով ավելի մեծ ու ցածր տոկոսադրույքներով միջոցներ:&nbsp;</p>\r\n', '<p><strong>Վերջին 10 տարվա ընթացքում Արցախում բանկային համակարգի բավականին լուրջ զարգացում է արձանագրվել, որն էական նշանակություն է ունեցել Արցախի տնտեսական հաջողությունների համար:</strong></p>\r\n\r\n<p><br />\r\nԱյս մասին ասել Հայաստանի վարչապետ Նիկոլ Փաշինյանը, ով&nbsp; Արցախի Հանրապետության (ԱՀ) նորընտիր նախագահ Արայիկ Հարությունյանի հետ Ստեփանակերտում հանդիպում է ունեցել ՀՀ եւ ԱՀ բանկային համակարգերի ներկայացուցիչների հետ` Կենտրոնական բանկերի ղեկավարների գլխավորությամբ:<br />\r\n<br />\r\n&laquo;Տնտեսական այն հավակնությունները, որ ունենք համատեղ, հնարավոր չի լինի իրագործել, եթե այդ բովանդակությունն ընկալված չլինի բանկային համակարգի կողմից: Ինչ որ առումով այդ բովանդակությունը պետք է համատեղ ձևավորվի:&nbsp; Հակաճգնաժամային այս ժամանակաշրջանում նաև դրա փորձը կիրառում ենք, երբ կառավարության, բանկային համակարգի ու խորհրդարանի ներկայացուցիչները մի սեղանի շուրջ նստած քննարկում են գյուղատնտեսության զարգացման, ճգնաժամը հաղթահարելու, սոցիալական խնդիրները լուծելու հարցեր: Սա իսկապես արդյունավետ կարող է լինել և սա պետք է դիտարկել ոչ թե առանձին վերցրած հանդիպում, այլ խոսակցություն, որն անընդհատ պետք է շարունակվի&raquo;,- նշել է Նիկոլ Փաշինյանը:<br />\r\n<br />\r\nԱրայիկ Հարությունյանն էլ ասել է, որ ցանկալի է ոչ թե շարունակել, այլ ավելի ակտիվացնել համագործակցությունը, &laquo;քանի որ առաջիկայում նախատեսում ենք զարգացման շատ ավելի մեծ տեմպեր ապահովել, իսկ միայն երկու կառավարությունների ֆինանսական միջոցները թույլ չեն տա դա անել&raquo;:<br />\r\n<br />\r\n&laquo;Պետք է լինելու ավելի հավակնոտ ծրագրեր իրականացնել&raquo;,- ասել է Արցախի նախագահը:<br />\r\n<br />\r\nՀանդիպման ընթացքում քննարկվել են ֆինանսական, բանկային համակարգերի համագործակցության ընդլայնմանը, Արցախում հայաստանյան բանկերի գործունեության խթանմանը, բիզնես ծրագրերի ֆինանսանավորման ակտիվացմանը, տնտեսության տարբեր ճյուղերում, այդ թվում` գյուղատնտեսության, ներդրումային նախագծերի ֆինանսավորմանը վերաբերող հարցեր:<br />\r\n<br />\r\nԲանկային համակարգի ներկայացուցիչները պատրաստակամություն են հայտնել ականջալուր լինել Հայաստանի և Արցախի կառավարությունների նախաձեռնություններին և առավել ընդլայնված կերպով ներգրավվել ծրագրերի իրականացմանը` շուկայի համար ապահովելով ավելի մեծ ու ցածր տոկոսադրույքներով միջոցներ:&nbsp;</p>\r\n', 'http://www.oferta.am/uploadBlog/Pashinyan.png', '2020-05-22 00:00:00');
INSERT INTO `userfularticlescontroller` VALUES (23, ' Неизбежная бесконтактность бытия', 'Неизбежная бесконтактность бытия', 'Неизбежная бесконтактность бытия', '<p><strong>Пандемия COVID-19 стимулирует развитие новых технологий и услуг</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Массовая самоизоляция, карантинные меры и социальное дистанцирование могут оказать влияние на поведение потребителей и после окончания пандемии. Эксперты и участники высокотехнологичного рынка считают, что одним из последствий эпидемии для рынка может стать более активное развитие бесконтактных технологий, которые позволят совершать платежи или получать услуги так же удобно и быстро как раньше, но с более тщательным соблюдением мер личной гигиены в общественных местах.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>По данным <a href=\"https://www.finextra.com/newsarticle/35747/pandemic-will-lead-to-push-for-touch-free-technology?utm_medium=dailynewsletter&amp;utm_source=2020-5-5&amp;member=61820\">опроса</a>, проведенного британской консалтинговой компанией Foolproof, большинство потребителей серьезно изменят свое отношение к использованию технологий на устройствах, расположенных в общественных местах. Это относится к банкоматам, платежным терминалам, билетным и вендинговым автоматам и т.&nbsp;п. 80% из опрошенных 2000 человек заявили, что они постараются максимально использовать бесконтактные технологии для обеспечения большей личной гигиены. Эксперты полагают, что даже после окончания пандемии такое изменение потребительских привычек может, с одной стороны, оказать серьезное влияние на банки, ритейлеров, индустрию транспорта, а с другой &mdash; стимулировать те сегменты высокотехнологичной индустрии, которые работают над бесконтактными способами оплаты, получения услуг и т.&nbsp;д.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Как отмечает сооснователь Foolproof Питер Баллард, &laquo;наше исследование ясно показывает, что люди сейчас гораздо хуже относятся к контактным технологиям, чем это было до пандемии. Более того, есть индикаторы, свидетельствующие о том, что такой настрой останется и после пандемии. Нам нужно принять то, что люди будут меньше хотеть дотрагиваться до вещей, чем это требуется от них сейчас&raquo;.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>В качестве примеров бесконтактных технологий, которые может стимулировать такая тенденция в поведении потребителей, Foolproof приводит уже ставшие довольно популярными голосовые помощники и умные колонки (Google Assistant, Amazon Alexa и т.&nbsp;п.).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Инженер-разработчик интегрированных систем Дэвид Атваттер из компании Enterprise Integration Group <a href=\"https://www.foolproof.co.uk/journal/touching-technology-preparing-for-a-post-pandemic-future/\">считает</a>, что после пандемии системы, позволяющие совершать операции при помощи голосовых команд, будут активнее устанавливаться в банкоматах, платежных и билетных терминалах и подобных устройствах, находящихся в общественных местах. Кроме того, он считает, что больший интерес будет проявлен к внедрению в общественных местах систем совершения команд при помощи жестов, которая сейчас существует в основном на персональных гаджетах (смартфоны, смартчасы и браслеты, плееры и т.&nbsp;д.).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Уже сейчас многие службы доставки по всему миру внедрили бесконтактную систему общения с потребителем &mdash; потребитель оплачивает заказ через онлайн-платеж при покупке, а курьер оставляет товар перед дверью.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Британский сервис обслуживания автомобилей Halfords уже <a href=\"https://www.bognor.co.uk/lifestyle/cars/halfords-launches-zero-contact-garage-service-2502143\">внедрил</a> систему ремонта и профилактики, при которой владелец машины вызывает мастеров, а саму машину оставляет либо перед домом, либо на ближайшей парковке.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Глава австралийского маркетингового агентства VMLY&amp;R Джон Берд <a href=\"https://www.forbes.com/sites/jonbird1/2020/03/29/zero-contact-everything-coronavirus-causes-the-rapid-rise-of-no-touch-retail/#2dda528538cf\">считает</a>, что еще одним направлением развития бесконтактных технологий после пандемии может стать активизация роботизированной доставки. Если до эпидемии роботизированная доставка в США и Европе, в том числе беспилотниками, проходила долгие и мучительные испытания и процессы сертификации государственными органами, то во время эпидемии китайские интернет-ритейлеры Alibaba и JD.com активно <a href=\"https://www.scmp.com/tech/e-commerce/article/3051597/chinas-e-commerce-giants-deploy-robots-deliver-orders-amid\">использовали</a> роботов-курьеров для доставки товаров в районах, наиболее пострадавших от эпидемии и закрытых на жесткий карантин.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>50% опрошенных FoolProof британских потребителей заявили, что и после эпидемии они будут использовать бесконтактные платежи, если для совершения данного платежа им доступен лимит от их банка.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>25% отметили, что будут реже пользоваться банкоматами, а 20% заявили, что будут чаще покупать продукты через интернет. &laquo;Мы полагаем, что изменения, которые наблюдаем уже сейчас &mdash; более активное использование стилусов, QR-кодов, более легкого совершения мобильных платежей и т.&nbsp;п., являются лишь промежуточным этапом более масштабного движения к экосистеме бесконтактных технологий&raquo;,&mdash; считает господин Баллард.</p>\r\n', '<p>Пандемия COVID-19 стимулирует развитие новых технологий и услуг</p>\r\n\r\n<p>Массовая самоизоляция, карантинные меры и социальное дистанцирование могут оказать влияние на поведение потребителей и после окончания пандемии. Эксперты и участники высокотехнологичного рынка считают, что одним из последствий эпидемии для рынка может стать более активное развитие бесконтактных технологий, которые позволят совершать платежи или получать услуги так же удобно и быстро как раньше, но с более тщательным соблюдением мер личной гигиены в общественных местах.</p>\r\n\r\n<p>По данным <a href=\"https://www.finextra.com/newsarticle/35747/pandemic-will-lead-to-push-for-touch-free-technology?utm_medium=dailynewsletter&amp;utm_source=2020-5-5&amp;member=61820\">опроса</a>, проведенного британской консалтинговой компанией Foolproof, большинство потребителей серьезно изменят свое отношение к использованию технологий на устройствах, расположенных в общественных местах. Это относится к банкоматам, платежным терминалам, билетным и вендинговым автоматам и т.&nbsp;п. 80% из опрошенных 2000 человек заявили, что они постараются максимально использовать бесконтактные технологии для обеспечения большей личной гигиены. Эксперты полагают, что даже после окончания пандемии такое изменение потребительских привычек может, с одной стороны, оказать серьезное влияние на банки, ритейлеров, индустрию транспорта, а с другой &mdash; стимулировать те сегменты высокотехнологичной индустрии, которые работают над бесконтактными способами оплаты, получения услуг и т.&nbsp;д.</p>\r\n\r\n<p>Как отмечает сооснователь Foolproof Питер Баллард, &laquo;наше исследование ясно показывает, что люди сейчас гораздо хуже относятся к контактным технологиям, чем это было до пандемии. Более того, есть индикаторы, свидетельствующие о том, что такой настрой останется и после пандемии. Нам нужно принять то, что люди будут меньше хотеть дотрагиваться до вещей, чем это требуется от них сейчас&raquo;.</p>\r\n\r\n<p>В качестве примеров бесконтактных технологий, которые может стимулировать такая тенденция в поведении потребителей, Foolproof приводит уже ставшие довольно популярными голосовые помощники и умные колонки (Google Assistant, Amazon Alexa и т.&nbsp;п.).</p>\r\n\r\n<p>Инженер-разработчик интегрированных систем Дэвид Атваттер из компании Enterprise Integration Group <a href=\"https://www.foolproof.co.uk/journal/touching-technology-preparing-for-a-post-pandemic-future/\">считает</a>, что после пандемии системы, позволяющие совершать операции при помощи голосовых команд, будут активнее устанавливаться в банкоматах, платежных и билетных терминалах и подобных устройствах, находящихся в общественных местах. Кроме того, он считает, что больший интерес будет проявлен к внедрению в общественных местах систем совершения команд при помощи жестов, которая сейчас существует в основном на персональных гаджетах (смартфоны, смартчасы и браслеты, плееры и т.&nbsp;д.).</p>\r\n\r\n<p>Уже сейчас многие службы доставки по всему миру внедрили бесконтактную систему общения с потребителем &mdash; потребитель оплачивает заказ через онлайн-платеж при покупке, а курьер оставляет товар перед дверью.</p>\r\n\r\n<p>Британский сервис обслуживания автомобилей Halfords уже <a href=\"https://www.bognor.co.uk/lifestyle/cars/halfords-launches-zero-contact-garage-service-2502143\">внедрил</a> систему ремонта и профилактики, при которой владелец машины вызывает мастеров, а саму машину оставляет либо перед домом, либо на ближайшей парковке.</p>\r\n\r\n<p>Глава австралийского маркетингового агентства VMLY&amp;R Джон Берд <a href=\"https://www.forbes.com/sites/jonbird1/2020/03/29/zero-contact-everything-coronavirus-causes-the-rapid-rise-of-no-touch-retail/#2dda528538cf\">считает</a>, что еще одним направлением развития бесконтактных технологий после пандемии может стать активизация роботизированной доставки. Если до эпидемии роботизированная доставка в США и Европе, в том числе беспилотниками, проходила долгие и мучительные испытания и процессы сертификации государственными органами, то во время эпидемии китайские интернет-ритейлеры Alibaba и JD.com активно <a href=\"https://www.scmp.com/tech/e-commerce/article/3051597/chinas-e-commerce-giants-deploy-robots-deliver-orders-amid\">использовали</a> роботов-курьеров для доставки товаров в районах, наиболее пострадавших от эпидемии и закрытых на жесткий карантин.</p>\r\n\r\n<p>50% опрошенных FoolProof британских потребителей заявили, что и после эпидемии они будут использовать бесконтактные платежи, если для совершения данного платежа им доступен лимит от их банка.</p>\r\n\r\n<p>25% отметили, что будут реже пользоваться банкоматами, а 20% заявили, что будут чаще покупать продукты через интернет. &laquo;Мы полагаем, что изменения, которые наблюдаем уже сейчас &mdash; более активное использование стилусов, QR-кодов, более легкого совершения мобильных платежей и т.&nbsp;п., являются лишь промежуточным этапом более масштабного движения к экосистеме бесконтактных технологий&raquo;,&mdash; считает господин Баллард.</p>\r\n', '<p>Пандемия COVID-19 стимулирует развитие новых технологий и услуг</p>\r\n\r\n<p>Массовая самоизоляция, карантинные меры и социальное дистанцирование могут оказать влияние на поведение потребителей и после окончания пандемии. Эксперты и участники высокотехнологичного рынка считают, что одним из последствий эпидемии для рынка может стать более активное развитие бесконтактных технологий, которые позволят совершать платежи или получать услуги так же удобно и быстро как раньше, но с более тщательным соблюдением мер личной гигиены в общественных местах.</p>\r\n\r\n<p>По данным <a href=\"https://www.finextra.com/newsarticle/35747/pandemic-will-lead-to-push-for-touch-free-technology?utm_medium=dailynewsletter&amp;utm_source=2020-5-5&amp;member=61820\">опроса</a>, проведенного британской консалтинговой компанией Foolproof, большинство потребителей серьезно изменят свое отношение к использованию технологий на устройствах, расположенных в общественных местах. Это относится к банкоматам, платежным терминалам, билетным и вендинговым автоматам и т.&nbsp;п. 80% из опрошенных 2000 человек заявили, что они постараются максимально использовать бесконтактные технологии для обеспечения большей личной гигиены. Эксперты полагают, что даже после окончания пандемии такое изменение потребительских привычек может, с одной стороны, оказать серьезное влияние на банки, ритейлеров, индустрию транспорта, а с другой &mdash; стимулировать те сегменты высокотехнологичной индустрии, которые работают над бесконтактными способами оплаты, получения услуг и т.&nbsp;д.</p>\r\n\r\n<p>Как отмечает сооснователь Foolproof Питер Баллард, &laquo;наше исследование ясно показывает, что люди сейчас гораздо хуже относятся к контактным технологиям, чем это было до пандемии. Более того, есть индикаторы, свидетельствующие о том, что такой настрой останется и после пандемии. Нам нужно принять то, что люди будут меньше хотеть дотрагиваться до вещей, чем это требуется от них сейчас&raquo;.</p>\r\n\r\n<p>В качестве примеров бесконтактных технологий, которые может стимулировать такая тенденция в поведении потребителей, Foolproof приводит уже ставшие довольно популярными голосовые помощники и умные колонки (Google Assistant, Amazon Alexa и т.&nbsp;п.).</p>\r\n\r\n<p>Инженер-разработчик интегрированных систем Дэвид Атваттер из компании Enterprise Integration Group <a href=\"https://www.foolproof.co.uk/journal/touching-technology-preparing-for-a-post-pandemic-future/\">считает</a>, что после пандемии системы, позволяющие совершать операции при помощи голосовых команд, будут активнее устанавливаться в банкоматах, платежных и билетных терминалах и подобных устройствах, находящихся в общественных местах. Кроме того, он считает, что больший интерес будет проявлен к внедрению в общественных местах систем совершения команд при помощи жестов, которая сейчас существует в основном на персональных гаджетах (смартфоны, смартчасы и браслеты, плееры и т.&nbsp;д.).</p>\r\n\r\n<p>Уже сейчас многие службы доставки по всему миру внедрили бесконтактную систему общения с потребителем &mdash; потребитель оплачивает заказ через онлайн-платеж при покупке, а курьер оставляет товар перед дверью.</p>\r\n\r\n<p>Британский сервис обслуживания автомобилей Halfords уже <a href=\"https://www.bognor.co.uk/lifestyle/cars/halfords-launches-zero-contact-garage-service-2502143\">внедрил</a> систему ремонта и профилактики, при которой владелец машины вызывает мастеров, а саму машину оставляет либо перед домом, либо на ближайшей парковке.</p>\r\n\r\n<p>Глава австралийского маркетингового агентства VMLY&amp;R Джон Берд <a href=\"https://www.forbes.com/sites/jonbird1/2020/03/29/zero-contact-everything-coronavirus-causes-the-rapid-rise-of-no-touch-retail/#2dda528538cf\">считает</a>, что еще одним направлением развития бесконтактных технологий после пандемии может стать активизация роботизированной доставки. Если до эпидемии роботизированная доставка в США и Европе, в том числе беспилотниками, проходила долгие и мучительные испытания и процессы сертификации государственными органами, то во время эпидемии китайские интернет-ритейлеры Alibaba и JD.com активно <a href=\"https://www.scmp.com/tech/e-commerce/article/3051597/chinas-e-commerce-giants-deploy-robots-deliver-orders-amid\">использовали</a> роботов-курьеров для доставки товаров в районах, наиболее пострадавших от эпидемии и закрытых на жесткий карантин.</p>\r\n\r\n<p>50% опрошенных FoolProof британских потребителей заявили, что и после эпидемии они будут использовать бесконтактные платежи, если для совершения данного платежа им доступен лимит от их банка.</p>\r\n\r\n<p>25% отметили, что будут реже пользоваться банкоматами, а 20% заявили, что будут чаще покупать продукты через интернет. &laquo;Мы полагаем, что изменения, которые наблюдаем уже сейчас &mdash; более активное использование стилусов, QR-кодов, более легкого совершения мобильных платежей и т.&nbsp;п., являются лишь промежуточным этапом более масштабного движения к экосистеме бесконтактных технологий&raquo;,&mdash; считает господин Баллард.</p>\r\n', 'http://www.oferta.am/uploadBlog/Digital world.png', '2020-05-23 00:00:00');
INSERT INTO `userfularticlescontroller` VALUES (24, 'Հայաստանում առաջին անգամ անկանխիկ գործարքները գերազանցել են կանխիկին. քարտերով շրջանառությունը I եռամսյակում աճել է 22,9%,–ով', 'Հայաստանում առաջին անգամ անկանխիկ գործարքները գերազանցել են կանխիկին. քարտերով շրջանառությունը I եռամսյակում աճել է 22,9%,–ով', 'Հայաստանում առաջին անգամ անկանխիկ գործարքները գերազանցել են կանխիկին. քարտերով շրջանառությունը I եռամսյակում աճել է 22,9%,–ով', '<p><strong>ԵՐԵՎԱՆ, 26 մայիսի./ԱՌԿԱ/.&nbsp;</strong>Հայաստանում պլաստիկ քարտերով գործարքների ծավալը 2020թ.&ndash;ի առաջին եռամսյակում կազմել է 592 174 մլն ՀՀ դրամ, որը 2019թ- ի առաջին եռամսյակի համեմատ (481 785 մլն դրամ) ավելացել է 22.9%, երեքշաբթի լրագրողներին ասաց Հայաստանի բանկերի միության գործադիր տնօրեն Սեյրան Սարգսյանն առցանց ասուլիսի ժամանակ։</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Նա նշեց, որ Հայաստանում սպասարկվում են գրեթե բոլոր վճարահաշվարկային համակարգերի քարտերը` սկսած ազգային ArCA-ից մինչև Visa, MasterCard, American Express, Diners Club, JCB (ճապոնական համակարգ)։</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Նրա խոսքով, Հայաստանում գործող ակտիվ վճարային քարտերի թիվը 2020թ.&ndash;ի առաջին եռամսյակի արդյունքում կազմել է 2 460 333, ինչը 2,9%&ndash;ով կամ 70 հազար քարտով ավել է` 2019թ.&ndash;ի համեմատ։</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&laquo;Վճարային քարտերով իրականացվել է 19 154 229 գործարք, ինչը 33,8%&ndash;ով ավել է 2019թ.&ndash;ի առաջին եռամսյակի ցուցանիշից (13 570 034)։ Այս քարտերով ընդհանուր առմամբ կատարվել է 592 մլրդ դրամի գործարք, ինչը 22,9 տոկոսով (481 մլրդ) գերազանցում է 2019թ.&ndash;ի նույն ժամանակահատվածի ցուցանիշը&raquo;, &ndash; ասաց Սարգսյանը։</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Նա նշեց, որ փաստորեն ինչպես գործարքների թիվը, այնպես էլ քարտերով իրականացված գործարքների ծավալը զգալիորեն ավելացել է։</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&laquo;Առաջին անգամ Հայաստանում անկանխիկ գործարքների թիվը գերազանցել է կանխիկ գործարքները (անկանխիկ`57%, կանխիկ`43%), ինչն ուրախացնում է։ Եթե 2020թ.&ndash;ի առաջին եռամսյակում կանխիկ գործարքների թիվը կազմել է 7 784 894, ինչը 2,4%&ndash;ով ավել է 2019թ.&ndash;ի առաջին եռամսյակի նույն ցուցանիշից, ապա անկանխիկ գործարքների թիվը, 2019թ.&ndash;ի առաջին եռամսյակի համեմատ, միանգամից ավելացել է 73,4%&ndash;ով (5 967 875) և կազմել 10 369 335&raquo;, &ndash; ասաց Սարգսյանը։</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Ինչ վերաբերում է քարտերով իրականացված գործարքների ծավալին, ապա, նրա խոսքով, դեռ, ցավոք, մոտ 70%&ndash;ը կազմում են կանխիկ գործարքները և միայն 30%&ndash;ն` անկանխիկ։</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&laquo;Սակայն այստեղ կան հետաքրքիր զարգացումներ։ Կանխիկ գործարքների ծավալը 2020թ.&ndash;ի առաջին եռամսյակի արդյունքում կազմել է 415,6 մլրդ դրամ, ինչը 13,3 տոկոսով ավել է 2019թ.&ndash;ի առաջին եռամսյակի նույն ցուցանիշից։ Իսկ անկանխիկ գործարքների ծավալը կազմել է 176,9 մլրդ դրամ, ինչը 53,4 տոկոսով ավել է 2019թ.&ndash;ի առաջին եռամսյակի ցուցանիշից&raquo; &ndash; ասաց Սարգսյանը։</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Նա նաև նշեց, որ բանկոմատների միջոցով իրականացված գործարքները կազմել են գործարքների ընդհանուր թվի 43 տոկոսը (13,3 տոկոսի աճ), POS-տերմինալներով իրականացված գործարքները` 24 տոկոսը (64,4 տոկոսի աճ), իսկ ինտերնետի միջոցով իրականացված գործարքները` ընդհանուր գործարքների 33 տոկոսը (80,3 տոկոսի աճ)։ Ծավալի առումով բանկոմատների միջոցով աճը կազմել է 18,6 տոկոս, ինտերնետի միջոցով` 73 տոկոս, POS տերմինալների միջոցով` 22 տոկոս։</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Նշվում է նաև գործարքի միջին չափի նվազում, բանկոմատներում այն կազմել է միջինը 51 հազար դրամ, առևտրի կետերում` 20 498 դրամ։</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&laquo;Դա վկայում է այն մասին, որ հաճախորդները սկսել են ավելի հաճախ օգտվել քարտից որպես վճարային միջոց, այդ թվում` փոքր գնումների համար, ինչը հանգեցրել է գործարքի միջին ծավալի ցուցանիշի նվազմանը&raquo;, &ndash; ասաց Սարգսյանը։ Հայաստանում բանկոմատների թիվը 2020թ.&ndash;ի առաջին եռամսյակի արդյունքում հասել է 1544&ndash;ի, իսկ բանկային քարտեր ընդունող առևտրային կետերի թիվը` 11,6 հազար:</p>\r\n', '<p><strong>ԵՐԵՎԱՆ, 26 մայիսի./ԱՌԿԱ/.&nbsp;</strong>Հայաստանում պլաստիկ քարտերով գործարքների ծավալը 2020թ.&ndash;ի առաջին եռամսյակում կազմել է 592 174 մլն ՀՀ դրամ, որը 2019թ- ի առաջին եռամսյակի համեմատ (481 785 մլն դրամ) ավելացել է 22.9%, երեքշաբթի լրագրողներին ասաց Հայաստանի բանկերի միության գործադիր տնօրեն Սեյրան Սարգսյանն առցանց ասուլիսի ժամանակ։</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Նա նշեց, որ Հայաստանում սպասարկվում են գրեթե բոլոր վճարահաշվարկային համակարգերի քարտերը` սկսած ազգային ArCA-ից մինչև Visa, MasterCard, American Express, Diners Club, JCB (ճապոնական համակարգ)։</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Նրա խոսքով, Հայաստանում գործող ակտիվ վճարային քարտերի թիվը 2020թ.&ndash;ի առաջին եռամսյակի արդյունքում կազմել է 2 460 333, ինչը 2,9%&ndash;ով կամ 70 հազար քարտով ավել է` 2019թ.&ndash;ի համեմատ։</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&laquo;Վճարային քարտերով իրականացվել է 19 154 229 գործարք, ինչը 33,8%&ndash;ով ավել է 2019թ.&ndash;ի առաջին եռամսյակի ցուցանիշից (13 570 034)։ Այս քարտերով ընդհանուր առմամբ կատարվել է 592 մլրդ դրամի գործարք, ինչը 22,9 տոկոսով (481 մլրդ) գերազանցում է 2019թ.&ndash;ի նույն ժամանակահատվածի ցուցանիշը&raquo;, &ndash; ասաց Սարգսյանը։</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Նա նշեց, որ փաստորեն ինչպես գործարքների թիվը, այնպես էլ քարտերով իրականացված գործարքների ծավալը զգալիորեն ավելացել է։</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&laquo;Առաջին անգամ Հայաստանում անկանխիկ գործարքների թիվը գերազանցել է կանխիկ գործարքները (անկանխիկ`57%, կանխիկ`43%), ինչն ուրախացնում է։ Եթե 2020թ.&ndash;ի առաջին եռամսյակում կանխիկ գործարքների թիվը կազմել է 7 784 894, ինչը 2,4%&ndash;ով ավել է 2019թ.&ndash;ի առաջին եռամսյակի նույն ցուցանիշից, ապա անկանխիկ գործարքների թիվը, 2019թ.&ndash;ի առաջին եռամսյակի համեմատ, միանգամից ավելացել է 73,4%&ndash;ով (5 967 875) և կազմել 10 369 335&raquo;, &ndash; ասաց Սարգսյանը։</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Ինչ վերաբերում է քարտերով իրականացված գործարքների ծավալին, ապա, նրա խոսքով, դեռ, ցավոք, մոտ 70%&ndash;ը կազմում են կանխիկ գործարքները և միայն 30%&ndash;ն` անկանխիկ։</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&laquo;Սակայն այստեղ կան հետաքրքիր զարգացումներ։ Կանխիկ գործարքների ծավալը 2020թ.&ndash;ի առաջին եռամսյակի արդյունքում կազմել է 415,6 մլրդ դրամ, ինչը 13,3 տոկոսով ավել է 2019թ.&ndash;ի առաջին եռամսյակի նույն ցուցանիշից։ Իսկ անկանխիկ գործարքների ծավալը կազմել է 176,9 մլրդ դրամ, ինչը 53,4 տոկոսով ավել է 2019թ.&ndash;ի առաջին եռամսյակի ցուցանիշից&raquo; &ndash; ասաց Սարգսյանը։</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Նա նաև նշեց, որ բանկոմատների միջոցով իրականացված գործարքները կազմել են գործարքների ընդհանուր թվի 43 տոկոսը (13,3 տոկոսի աճ), POS-տերմինալներով իրականացված գործարքները` 24 տոկոսը (64,4 տոկոսի աճ), իսկ ինտերնետի միջոցով իրականացված գործարքները` ընդհանուր գործարքների 33 տոկոսը (80,3 տոկոսի աճ)։ Ծավալի առումով բանկոմատների միջոցով աճը կազմել է 18,6 տոկոս, ինտերնետի միջոցով` 73 տոկոս, POS տերմինալների միջոցով` 22 տոկոս։</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Նշվում է նաև գործարքի միջին չափի նվազում, բանկոմատներում այն կազմել է միջինը 51 հազար դրամ, առևտրի կետերում` 20 498 դրամ։</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&laquo;Դա վկայում է այն մասին, որ հաճախորդները սկսել են ավելի հաճախ օգտվել քարտից որպես վճարային միջոց, այդ թվում` փոքր գնումների համար, ինչը հանգեցրել է գործարքի միջին ծավալի ցուցանիշի նվազմանը&raquo;, &ndash; ասաց Սարգսյանը։ Հայաստանում բանկոմատների թիվը 2020թ.&ndash;ի առաջին եռամսյակի արդյունքում հասել է 1544&ndash;ի, իսկ բանկային քարտեր ընդունող առևտրային կետերի թիվը` 11,6 հազար:</p>\r\n', '<p><strong>ԵՐԵՎԱՆ, 26 մայիսի./ԱՌԿԱ/.&nbsp;</strong>Հայաստանում պլաստիկ քարտերով գործարքների ծավալը 2020թ.&ndash;ի առաջին եռամսյակում կազմել է 592 174 մլն ՀՀ դրամ, որը 2019թ- ի առաջին եռամսյակի համեմատ (481 785 մլն դրամ) ավելացել է 22.9%, երեքշաբթի լրագրողներին ասաց Հայաստանի բանկերի միության գործադիր տնօրեն Սեյրան Սարգսյանն առցանց ասուլիսի ժամանակ։</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Նա նշեց, որ Հայաստանում սպասարկվում են գրեթե բոլոր վճարահաշվարկային համակարգերի քարտերը` սկսած ազգային ArCA-ից մինչև Visa, MasterCard, American Express, Diners Club, JCB (ճապոնական համակարգ)։</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Նրա խոսքով, Հայաստանում գործող ակտիվ վճարային քարտերի թիվը 2020թ.&ndash;ի առաջին եռամսյակի արդյունքում կազմել է 2 460 333, ինչը 2,9%&ndash;ով կամ 70 հազար քարտով ավել է` 2019թ.&ndash;ի համեմատ։</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&laquo;Վճարային քարտերով իրականացվել է 19 154 229 գործարք, ինչը 33,8%&ndash;ով ավել է 2019թ.&ndash;ի առաջին եռամսյակի ցուցանիշից (13 570 034)։ Այս քարտերով ընդհանուր առմամբ կատարվել է 592 մլրդ դրամի գործարք, ինչը 22,9 տոկոսով (481 մլրդ) գերազանցում է 2019թ.&ndash;ի նույն ժամանակահատվածի ցուցանիշը&raquo;, &ndash; ասաց Սարգսյանը։</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Նա նշեց, որ փաստորեն ինչպես գործարքների թիվը, այնպես էլ քարտերով իրականացված գործարքների ծավալը զգալիորեն ավելացել է։</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&laquo;Առաջին անգամ Հայաստանում անկանխիկ գործարքների թիվը գերազանցել է կանխիկ գործարքները (անկանխիկ`57%, կանխիկ`43%), ինչն ուրախացնում է։ Եթե 2020թ.&ndash;ի առաջին եռամսյակում կանխիկ գործարքների թիվը կազմել է 7 784 894, ինչը 2,4%&ndash;ով ավել է 2019թ.&ndash;ի առաջին եռամսյակի նույն ցուցանիշից, ապա անկանխիկ գործարքների թիվը, 2019թ.&ndash;ի առաջին եռամսյակի համեմատ, միանգամից ավելացել է 73,4%&ndash;ով (5 967 875) և կազմել 10 369 335&raquo;, &ndash; ասաց Սարգսյանը։</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Ինչ վերաբերում է քարտերով իրականացված գործարքների ծավալին, ապա, նրա խոսքով, դեռ, ցավոք, մոտ 70%&ndash;ը կազմում են կանխիկ գործարքները և միայն 30%&ndash;ն` անկանխիկ։</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&laquo;Սակայն այստեղ կան հետաքրքիր զարգացումներ։ Կանխիկ գործարքների ծավալը 2020թ.&ndash;ի առաջին եռամսյակի արդյունքում կազմել է 415,6 մլրդ դրամ, ինչը 13,3 տոկոսով ավել է 2019թ.&ndash;ի առաջին եռամսյակի նույն ցուցանիշից։ Իսկ անկանխիկ գործարքների ծավալը կազմել է 176,9 մլրդ դրամ, ինչը 53,4 տոկոսով ավել է 2019թ.&ndash;ի առաջին եռամսյակի ցուցանիշից&raquo; &ndash; ասաց Սարգսյանը։</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Նա նաև նշեց, որ բանկոմատների միջոցով իրականացված գործարքները կազմել են գործարքների ընդհանուր թվի 43 տոկոսը (13,3 տոկոսի աճ), POS-տերմինալներով իրականացված գործարքները` 24 տոկոսը (64,4 տոկոսի աճ), իսկ ինտերնետի միջոցով իրականացված գործարքները` ընդհանուր գործարքների 33 տոկոսը (80,3 տոկոսի աճ)։ Ծավալի առումով բանկոմատների միջոցով աճը կազմել է 18,6 տոկոս, ինտերնետի միջոցով` 73 տոկոս, POS տերմինալների միջոցով` 22 տոկոս։</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Նշվում է նաև գործարքի միջին չափի նվազում, բանկոմատներում այն կազմել է միջինը 51 հազար դրամ, առևտրի կետերում` 20 498 դրամ։</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&laquo;Դա վկայում է այն մասին, որ հաճախորդները սկսել են ավելի հաճախ օգտվել քարտից որպես վճարային միջոց, այդ թվում` փոքր գնումների համար, ինչը հանգեցրել է գործարքի միջին ծավալի ցուցանիշի նվազմանը&raquo;, &ndash; ասաց Սարգսյանը։ Հայաստանում բանկոմատների թիվը 2020թ.&ndash;ի առաջին եռամսյակի արդյունքում հասել է 1544&ndash;ի, իսկ բանկային քարտեր ընդունող առևտրային կետերի թիվը` 11,6 հազար:</p>\r\n', 'http://www.oferta.am/uploadBlog/Ankankhik (1).png', '2020-05-28 00:00:00');
INSERT INTO `userfularticlescontroller` VALUES (25, 'Խորհրդարանն ընդունեց սպառողական կրեդիտավորմանն առնչվող նոր նախագիծը', 'Խորհրդարանն ընդունեց սպառողական կրեդիտավորմանն առնչվող նոր նախագիծը', 'Խորհրդարանն ընդունեց սպառողական կրեդիտավորմանն առնչվող նոր նախագիծը', '<p>ՀՀ ազգային ժողովն ընդունեց &laquo;Իմ քայլը &raquo; խմբակցության պատգամավորներ Արտակ Մանուկյանն ու Վարազդատ Կարապետյանի կողմից ներկայացված օրենքի նախագիծ, որով, ըստ էության, սպառողական կրեդիտավորման համար սահմանվում են նոր պահանջներ՝ այդ թվում սպառողի վարկունակության մասով:&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&laquo;Արմենպրես&raquo;-ի հաղորդմամբ՝&laquo;Սպառողական կրեդիտավորման մասին&raquo; Հայաստանի Հանրապետության օրենքում լրացումներ կատարելու մասին օրենքն ԱԺ նիստում ստացավ 112 &laquo;կողմ&raquo; ձայն:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Նախագծով սահմանվում է, որ կրեդիտավորման պայմանագրում սպառողը ձեռագրով, իսկ էլեկտրոնային եղանակով պայմանագիր կնքելու դեպքում՝ էլեկտրոնային եղանակով տպագրելու միջոցով գրում է, որ գիտակցում է տարեկան փաստացի տոկոսադրույքի չափը՝ նշելով այդ տոկոսադրույքը:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;Մինչև 300 հազար դրամ և 3 ամիս ժամկետով վարկերի դեպքում առաջարկվում են կանոնակարգումներ, որով ԿԲ-ն կսահմանի որոշակի նորմատիվ իրավական պահանջներ՝ այդ թվում սպառողի վարկունակության մասով: Այսպիսով, ԿԲ-ն կսահմանի պարտադիր պահանջներ եւ պայմաններ, վարկավորման կանոններ՝ հիմք ընդունելով սպառողի վարկունակության, սպառողի պարտքի եւ եկամտի հարաբերակցության, վարկը սպասարկելու սպառողի ունակության գնահատման չափանիշները:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Կարգավորումներն ուժի մեջ կմտնեն 2021 թվականի հունվարի 1-ից:</p>\r\n', '<p>ՀՀ ազգային ժողովն ընդունեց &laquo;Իմ քայլը &raquo; խմբակցության պատգամավորներ Արտակ Մանուկյանն ու Վարազդատ Կարապետյանի կողմից ներկայացված օրենքի նախագիծ, որով, ըստ էության, սպառողական կրեդիտավորման համար սահմանվում են նոր պահանջներ՝ այդ թվում սպառողի վարկունակության մասով:&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&laquo;Արմենպրես&raquo;-ի հաղորդմամբ՝&laquo;Սպառողական կրեդիտավորման մասին&raquo; Հայաստանի Հանրապետության օրենքում լրացումներ կատարելու մասին օրենքն ԱԺ նիստում ստացավ 112 &laquo;կողմ&raquo; ձայն:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Նախագծով սահմանվում է, որ կրեդիտավորման պայմանագրում սպառողը ձեռագրով, իսկ էլեկտրոնային եղանակով պայմանագիր կնքելու դեպքում՝ էլեկտրոնային եղանակով տպագրելու միջոցով գրում է, որ գիտակցում է տարեկան փաստացի տոկոսադրույքի չափը՝ նշելով այդ տոկոսադրույքը:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;Մինչև 300 հազար դրամ և 3 ամիս ժամկետով վարկերի դեպքում առաջարկվում են կանոնակարգումներ, որով ԿԲ-ն կսահմանի որոշակի նորմատիվ իրավական պահանջներ՝ այդ թվում սպառողի վարկունակության մասով: Այսպիսով, ԿԲ-ն կսահմանի պարտադիր պահանջներ եւ պայմաններ, վարկավորման կանոններ՝ հիմք ընդունելով սպառողի վարկունակության, սպառողի պարտքի եւ եկամտի հարաբերակցության, վարկը սպասարկելու սպառողի ունակության գնահատման չափանիշները:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Կարգավորումներն ուժի մեջ կմտնեն 2021 թվականի հունվարի 1-ից:</p>\r\n', '<p>ՀՀ ազգային ժողովն ընդունեց &laquo;Իմ քայլը &raquo; խմբակցության պատգամավորներ Արտակ Մանուկյանն ու Վարազդատ Կարապետյանի կողմից ներկայացված օրենքի նախագիծ, որով, ըստ էության, սպառողական կրեդիտավորման համար սահմանվում են նոր պահանջներ՝ այդ թվում սպառողի վարկունակության մասով:&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&laquo;Արմենպրես&raquo;-ի հաղորդմամբ՝&laquo;Սպառողական կրեդիտավորման մասին&raquo; Հայաստանի Հանրապետության օրենքում լրացումներ կատարելու մասին օրենքն ԱԺ նիստում ստացավ 112 &laquo;կողմ&raquo; ձայն:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Նախագծով սահմանվում է, որ կրեդիտավորման պայմանագրում սպառողը ձեռագրով, իսկ էլեկտրոնային եղանակով պայմանագիր կնքելու դեպքում՝ էլեկտրոնային եղանակով տպագրելու միջոցով գրում է, որ գիտակցում է տարեկան փաստացի տոկոսադրույքի չափը՝ նշելով այդ տոկոսադրույքը:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;Մինչև 300 հազար դրամ և 3 ամիս ժամկետով վարկերի դեպքում առաջարկվում են կանոնակարգումներ, որով ԿԲ-ն կսահմանի որոշակի նորմատիվ իրավական պահանջներ՝ այդ թվում սպառողի վարկունակության մասով: Այսպիսով, ԿԲ-ն կսահմանի պարտադիր պահանջներ եւ պայմաններ, վարկավորման կանոններ՝ հիմք ընդունելով սպառողի վարկունակության, սպառողի պարտքի եւ եկամտի հարաբերակցության, վարկը սպասարկելու սպառողի ունակության գնահատման չափանիշները:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Կարգավորումներն ուժի մեջ կմտնեն 2021 թվականի հունվարի 1-ից:</p>\r\n', 'http://www.oferta.am/uploadBlog/sparoghakan orenq.png', '2020-06-03 00:00:00');
